INSERT INTO `cbt_jawaban` (`jawaban_id`, `jawaban_soal_id`, `jawaban_detail`, `jawaban_benar`, `jawaban_aktif`) VALUES ('3047', '744', '\r\n			<p style=\"text-align:justify\">Sehubungan dengan iklan Bapak yang dimuat dalam harian <em>Kabar Baik</em>, 30 Desember 2019 bahwa perusahaan Bapak membutuhkan seorang akunting yang berpengalaman, wanita, lulusan D-3, dan memiliki IPK minimal 2,75, dengan surat ini, saya mengajukan surat lamaran pekerjaan.</p>\r\n			', 1, 1);
INSERT INTO `cbt_jawaban` (`jawaban_id`, `jawaban_soal_id`, `jawaban_detail`, `jawaban_benar`, `jawaban_aktif`) VALUES ('3048', '744', '\r\n			<p>Setelah membaca iklan Bapak yang dimuat dalam harian <em>Kabar Baik,</em> 30 Desember, saya tertarik dengan syarat-syarat yang Bapak tuliskan dalam iklan tersebut, kemudian saya mengajukan surat lamaran pekerjaan ini kepada Bapak agar diterima menjadi pegawai.</p>\r\n			', 0, 1);
INSERT INTO `cbt_jawaban` (`jawaban_id`, `jawaban_soal_id`, `jawaban_detail`, `jawaban_benar`, `jawaban_aktif`) VALUES ('3049', '744', '\r\n			<p>Bapak memasang iklan lowongan pekerjaan dalam harian <em>Kabar Baik</em>, 30 Desember 2019 dengan syarat-syarat wanita, lulusan D-3 akuntansi, dan memiliki IPK 2,75. Karena itu, saya mencoba mengajukan surat lamaran ini agar diterima sebagai karyawan baru di perusahaan Bapak.</p>\r\n			', 0, 1);
INSERT INTO `cbt_jawaban` (`jawaban_id`, `jawaban_soal_id`, `jawaban_detail`, `jawaban_benar`, `jawaban_aktif`) VALUES ('3050', '744', '\r\n			<p>Perusahaan Bapak membutuhkan karyawan baru dengan syarat-syarat wanita, lulusan D-3, akuntansi, memiliki IPK 2,75. Saya merasa memenuhi persyaratan tersebut, maka saya mengajukan lamaran ini agar kiranya Bapak sudi menerima diri saya.</p>\r\n			', 0, 1);
INSERT INTO `cbt_jawaban` (`jawaban_id`, `jawaban_soal_id`, `jawaban_detail`, `jawaban_benar`, `jawaban_aktif`) VALUES ('3051', '744', '\r\n			<p>Dalam harian <em>Kabar Baik, </em>&nbsp;Bapak memasang iklan lowongan pekerjaan dengan syarat-syarat wanita, lulusan D-3, dan memiliki IPK di atas 2,75. Bersama ini saya mengajukan surat lamaran pekerjaan kepada Bapak agar Bapak mau menerima saya bekerja.</p>\r\n			', 0, 1);
INSERT INTO `cbt_jawaban` (`jawaban_id`, `jawaban_soal_id`, `jawaban_detail`, `jawaban_benar`, `jawaban_aktif`) VALUES ('3052', '745', '\r\n			<p>Menanggapi surat lamaran Saudara, kami mengharap kehadiran Saudara untuk mengikuti ujian tulis.</p>\r\n			', 0, 1);
