INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('291', '20', '\r\n			<p>Suatu format buku digital yang diciptakan oleh Adobe dalam produk Acrobat yang digunakan dalam pertukaran dokumen. Format tersebut didukung oleh semua platform komputer dan perangkat Smartphone.</p>\r\n\r\n			<p>Berdasarkan pernyataan tersebut merupakan format buku digital jenis &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('292', '20', '\r\n			<p>Perhatikan pernyataan berikut !</p>\r\n\r\n			<ol><li>Sarana pembelajaran</li>\r\n				<li>Media bisnis</li>\r\n				<li>Memudahkan untuk belajar kelompok</li>\r\n				<li>Memudahkan guru untuk memberi tugas</li>\r\n				<li>Mudahnya menggunakan platfrom</li>\r\n			</ol><p>Dari pernyataan diatas yang merupakan fungsi buku digital adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('293', '20', '\r\n			<p>Sebuah publikasi yang terdiri dari teks, gambar, maupun suara dan dipublikasikan dalam bentuk digital disebut ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('294', '20', '\r\n			<p style=\"text-align:justify\">Sebuah format proprietary Amazon, yang menyerupai format MOBI kadang-kadang dengan dan kadang-kadang tanpa menyertakan Digital Rights Management (DRM). DRM pada format ini dikhususkan untuk Kindle Amazon.adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('295', '20', '\r\n			<p>Pada persiapan naskah digital, pembaca yang menggunakan feature phone tidak dapat menampilkan EPUB yang menyertakan video maupun audio. Oleh karena itu penyiapan materi harus diupayakan agar bagian dari isi naskah dapat berdiri sendiri atau bersifat modular. Maka hal yang perlu diperhatikan pada proses penyiapan materi untuk dikonversi menjadi naskah digital adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('296', '20', '\r\n			<p>Sigil telah mendukung import file rekaman video dan rekaman suara ke dalam dokumen EPUB. Saat ini format yang didukung oleh EPUB adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('297', '20', '<p>Rani ditunjuk menjadi bendahara di kelasnya. Rani bertugas mengumpulkan uang kas untuk membeli alat kebersihan kelas. Supaya tidak bingung, Rani ingin membuat laporan keuangan yang menunjukkan pemasukan dan pengeluaran uang kas. Aplikasi apa yang cocok digunakan Rani untuk membuatlaporan keuangan dan grafiknya?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('298', '20', '<p>Tujuan diadakannya komunikasi daring adalah sebagai media yang memudahkan kita untuk saling berinteraksi antara satu dengan yang lainnya tanpa dibatasi oleh ruang dan waktu. Akan tetapi dengan semua kemudahan tersebut banyak sekali dampak positif dan negatifnya. Coba jelaskan keunggulan dan kelemahan penggunaan komunikasi dalam jaringan!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('299', '20', '<p>Sebutkan 1 aplikasi Social Learning Networks (SLN) yang kalian ketahui?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('300', '20', '<p>Dari hasil pengambilan gambar/ video dengan menggunakan handphone, diketahui format file-nya tidak bisa dimasukkan atau di-import pada software aplikasi video editingnya, bagaimana cara mengatasinya?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
