INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('448', '34', '\r\n			<p style=\"text-align:justify\">Beberapa tenunan dengan silang kepar antara lain drill, jeans, denim, gabardin. Tenunan dari silang kepar memiliki ciri khas satu benang lusi menyilang di atas atau dibawah dua benang pakan dengan silangan benang lusi sebelah kiri atau kanan bergeser satu benang pakan yang membentuk garis&hellip;..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
