INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('461', '14', '\r\n			<p>Suku ke 3 dan ke 6 barisan geometri berturut &ndash; turut 12 dan 96. Jumlah 7 suku pertamanya adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('462', '14', '\r\n			<p>Bian adalah seorang pegawai baru di suatu perusahaan. Mula &ndash; mula dia mendapat gaji Rp 2500.000,00. Tetapi tiap bulan dia mendapat tambahan gaji Rp 10.000,00. Berapa gaji Bian setelah 5 tahun bekerja di perusahaan tersebut?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('463', '14', '\r\n			<p>Reza menabung di bank dengan bunga tunggal 8% per tahun. Mula &ndash; mula dia menabung sebesar Rp 5000.000,00. Tabungan Reza setelah 15 bulan adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
