INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('465', '14', '<p style=\"text-align:justify\">Uwais melihat puncak menara dengan sudut elevasi <em>60&deg;</em>. Tinggi gedung dari tanah 121,6 m dan tinggi Uwais 160 cm. Jarak Uwais ke gedung adalah ....</p>\r\n', 1, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('466', '14', '<p>Diketahui matriks A = <img src=\"[base_url]uploads/mapel_14/6413c57f56ccd.png\" style=\"height:35px; width:57px\" />, B = <img src=\"[base_url]uploads/mapel_14/6413c57f56d72.png\" style=\"height:35px; width:57px\" />, dan C =&nbsp;<img src=\"[base_url]uploads/mapel_14/6413c57f56dfd.png\" style=\"height:35px; width:69px\" />. Nilai 2A &ndash; B + C adalah&hellip;.</p>\r\n', 1, '', 1, 1, NULL, 0, NULL, 0, 0);
