INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('486', '23', '<p>Perhatikan gambar di bawah ini!</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_23/64142bae0d0df.png\" /></p>\r\n\r\n<p>Pada titik P dari sebuah rangkaian listrik ada 4 cabang, 2 cabang masuk dan 2 cabang&nbsp; keluar. Jika diketahui besarnya I<sub>1</sub>&nbsp;= 10 A, I<sub>2</sub>&nbsp;= 16 A, dan I<sub>3</sub>&nbsp;= 19 A, tentukan besar nilai dari I<sub>4</sub> ?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('487', '23', '<p>Perhatikan gambar pembentukan bayangan pada lensa cembung berikut ini!&nbsp;</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_23/64142bf004c46.png\" /></p>\r\n\r\n<p style=\"text-align:justify\">Berdasarkan gambar di atas, tentukan jarak fokus lensa tersebut !</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('488', '23', '<p>Gambar di bawah ini menunjukkan grafik hubungan antara suhu dengan jumlah kalor dari zat padat yang dipanasi menjadi uap. Jika massa benda 2 kg, tentukan besar kalor lebur zat tersebut?</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_23/64142c41e9635.png\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('489', '23', '<p>Tiga buah kapasitor dengan kapasitas 12&mu;F dirangkai secara seri (lihat gambar). Tentukan besar kapasitas kapasitor penggantinya?</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_23/64142c6cc782a.png\" /></p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('490', '23', '\r\n			<p style=\"text-align:justify\">Wenda sedang menderita sakit flu, ia merasakan badannya demam. Kemudian dia mengambil termometer untuk mengukur suhu badannya. Hasil pembacaan termometer menunjukkan angka 38<sup>o</sup>C. Dari ilustrasi tersebut yang merupakan satuan adalah ...............</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('491', '23', '<p>Perhatikan tabel berikut ini!</p>\r\n\r\n<p><img id=\"Picture_x0020_1\" src=\"[base_url]uploads/mapel_23/64142d58a5d04.png\" style=\"height:145.5pt; width:303.75pt\" /></p>\r\n\r\n<p>Yang merupakan besaran pokok adalah &hellip;.</p>\r\n', 1, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('492', '23', '\r\n			<p style=\"text-align:justify\">Vania berangkat sekolah dengan mengendarai sepeda motor. Dia melihat jarum speedometer menunjukan angka 45 km/jam. Apabila satuan kelajuan tersebut dikonversikan ke dalam Sistem Internasional menjadi ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('493', '23', '\r\n			<p style=\"text-align:justify\">Gabriel mengukur panjang rusuk sebuah kardus yang berbentuk balok&nbsp; dengan menggunakan jangka sorong dan mendapatkan hasil panjang 10,37 cm, lebar 8,21 cm, dan tinggi 6,17 cm. Volume kardus tersebut menurut aturan angka penting adalah....cm<sup>3</sup></p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('494', '23', '\r\n			<p style=\"text-align:justify\">Seorang peserta didik melakukan pengukuran diameter dalam pipa rongga dengan mikrometer sekrup. Dari hasil pengukuran didapatkan hasil seperti gambar berikut ....</p>\r\n\r\n			<p style=\"text-align:justify\"><img id=\"Picture_x0020_5\" src=\"[base_url]uploads/mapel_23/64142d591ff03.png\" style=\"height:165pt; width:305.25pt\"></p>\r\n\r\n			<p style=\"text-align:justify\">Panjang diameter dalam pipa adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('495', '23', '\r\n			<p>Sebuah benda yang beratnya 15 N berada pada bidang datar. Pada benda tersebut bekerja sebuah gaya mendatar sebesar 30 N sehingga benda berpindah sejauh 150 cm. Besar usaha yang dilakukan oleh gaya tersebut adalah&hellip;..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('496', '23', '\r\n			<p style=\"text-align:justify\">Perhatikan pernyataan-pernyataan di bawah ini:</p>\r\n\r\n			<ol><li style=\"text-align:justify\">Seorang anak yang berlari di tempat melakukan usaha yang nilainya tidak nol.</li>\r\n				<li style=\"text-align:justify\">Seorang yang berenang dari satu sisi kolam ke sisi kolam yang lain melakukan usaha yang nilainya positif.</li>\r\n				<li style=\"text-align:justify\">Seorang anak yang berlari mengelilingi lapangan sebanyak lima kali melakukan usaha yang nilainya nol karena posisi awal dan akhir sama.</li>\r\n				<li style=\"text-align:justify\">Seorang yang sedang berjalan dari kelas menuju ke taman melakukan usaha yang nilainya negatif.</li>\r\n			</ol><p style=\"text-align:justify\">Dari pernyataan-pernyataan di atas, pernyataan yang benar adalah.......</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('497', '23', '\r\n			<p style=\"text-align:justify\">Perhatikan gambar di bawah ini:</p>\r\n\r\n			<p><img id=\"Picture_x0020_6\" src=\"[base_url]uploads/mapel_23/64142d599a8c0.png\" style=\"height:226.5pt; width:425.25pt\"></p>\r\n\r\n			<p>Kanal air bendungan setinggi 100 m digunakan sebagai pembangkit listrik tenaga air (PLTA). Setiap detik air mengalir 10 m<sup>3</sup>. Jika efesiensi generator 55%, percepatan gravitasi g = 10 m/s&sup2;, dan &nbsp;massa jenis air 1000 kg/m<sup>3</sup>, <sup>&nbsp;</sup>maka daya rata-rata yang dihasilkan (dalam kW) adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('498', '23', '\r\n			<p>Sebuah mobil bermassa 40000 kg bergerak dengan kecepatan awal 10 m/s di atas jalan yang kasar. Besar energi kinetik dari mobil tersebut adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('499', '23', '\r\n			<p>Sebuah batu memiliki massa 5 kg dijatuhkan dari ketinggian 40 meter. Jika percepatan gravitasi 10m/s<sup>2</sup>, maka besar energi potensial batu tersebut adalah.................</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('500', '23', '\r\n			<p>Seutas kawat yang panjangnya 25 cm diregangkan sehingga bertambah panjang 0,05 cm. Regangan yang terjadi pada kawat adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('501', '23', '\r\n			<p>Seutas kawat tembaga yang mempunyai luas penampangnya 10 cm<sup>2</sup> diberi gaya 50 N. Tegangan kawat yang terjadi adalah ...N/m<sup>2</sup></p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('502', '23', '\r\n			<p>Tegangan yang terjadi pada balok besi yang ditekan dengan luas penampang 150 cm<sup>2</sup> adalah 30000 N/m<sup>2</sup>. Besarnya gaya tekan pada balok besi adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('503', '23', '\r\n			<p>Perhatikan&nbsp; data nilai tegangan dan regangan dari beberapa benda di bawah ini!</p>\r\n\r\n			<p style=\"text-align:justify\"><img id=\"Picture_x0020_8\" src=\"[base_url]uploads/mapel_23/64142d5a57d8c.png\" style=\"height:158.25pt; width:402.75pt\"></p>\r\n\r\n			<p>Berdasarkan data diatas, nilai modulus young dari urutan paling besar ke yang kecil adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('504', '23', '\r\n			<p style=\"text-align:justify\">Perhatikan pernyataan-pernyataan di bawah ini :</p>\r\n\r\n			<ol><li style=\"text-align:justify\">Frekuensi bunyi dari suatu sumber bunyi oleh seorang pendengar akan terdengar bertambah jika sumber bunyi mendekati pendengar dan pendengar diam.</li>\r\n				<li style=\"text-align:justify\">Frekuensi bunyi dari suatu sumber bunyi oleh seorang pendengar akan terdengar bertambah jika sumber diam dan pendengar mendekati sumber.</li>\r\n				<li style=\"text-align:justify\">Frekuensi bunyi dari suatu sumber bunyi oleh seorang pendengar akan terdengar berkurang jika pendengar diam dan sumber bergerak menjauhi pendengar.</li>\r\n				<li style=\"text-align:justify\">Frekuensi bunyi dari suatu sumber bunyi oleh seorang pendengar akan terdengar berkurang jika sumber bunyi dan pendengar diam.</li>\r\n			</ol><p style=\"text-align:justify\">Dari pernyataan-pernyataan di atas, pernyataan yang benar adalah.......</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('505', '23', '\r\n			<p>Perhatikan gambar berikut ini!</p>\r\n\r\n			<p style=\"text-align:justify\"><img id=\"Picture_x0020_9\" src=\"[base_url]uploads/mapel_23/64142d5ab5cd8.png\" style=\"height:111pt; width:176.25pt\"></p>\r\n\r\n			<p style=\"text-align:justify\">Suatu nyala lilin digeser menjauhi suatu cermin sehingga bayangan dapat ditangkap layar pada gambar.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;(1) Cermin tersebut adalah cermin cekung</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;(2) Jarak benda ke cermin lebih kecil dari jari-jari kelengkungan cermin</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;(3) Jarak bayangan lebih besar dari jari-jari kelengkungan cermin</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;(4) Jarak fokus cermin negatif</p>\r\n\r\n			<p style=\"text-align:justify\">Pernyataan yang benar adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('506', '23', '\r\n			<p>Perhatikan gambar berikut ini!</p>\r\n\r\n			<p><img id=\"Picture_x0020_10\" src=\"[base_url]uploads/mapel_23/64142d5ada9e0.png\" style=\"height:116.25pt; width:409.5pt\"></p>\r\n\r\n			<p style=\"text-align:justify\">Sebuah lup memiliki jarak fokus 25 cm dipakai seseorang untuk melihat benda kecil&nbsp;yang berjarak 5 cm dari lup. Perbesaran anguler lup dengan pengamatan akomodasi maksimum adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('507', '23', '\r\n			<p style=\"text-align:justify\">Titik dekat mata seorang anak terletak pada jarak 100 cm di depan mata. Untuk melihat dengan jelas suatu benda yang terletak 40 cm didepan mata, kekuatan lensa kacamata yang harus dipakai berdaya (dalam dioptri)....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('508', '23', '\r\n			<p>Perhatikan gambar di bawah ini!</p>\r\n\r\n			<p><img id=\"Picture_x0020_11\" src=\"[base_url]uploads/mapel_23/64142d5b3003c.png\" style=\"height:124.5pt; width:416.25pt\"></p>\r\n\r\n			<p style=\"text-align:justify\">Seorang siswa melihat bulan dengan teropong bintang yang memiliki panjang fokus objektif 120 cm. Jika perbesaran sudutnya 4 kali dan mata tidak berakomodasi, maka panjang teropong bintang itu adalah &hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('509', '23', '<p>Fandi memanaskan 500 gram logam dari suhu 10&deg;C hingga 210&deg;C, ternyata diperlukan kalor 40.000 joule. Jenis logam dan kalor jenisnya yang benar adalah &hellip;.</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_23/641814afc8769.png\" /></p>\r\n', 1, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('510', '23', '\r\n			<p>Seorang perawat mengukur suhu badan seorang pasien dan mendapatkan angka 38<sup>o</sup>C,&nbsp; jika perawat menggunakan termometer skala Reamur maka angka yang ditunjukkan oleh termometer tersebut adalah....... <sup>0</sup>R</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('511', '23', '\r\n			<p style=\"text-align:justify\">Diketahui muatan listrik Q<sub>1</sub>&nbsp;positif dan Q<sub>2</sub>&nbsp;negatif</p>\r\n\r\n			<p style=\"text-align:justify\">(1) muatan Q<sub>1</sub>&nbsp;menarik muatan Q<sub>2</sub></p>\r\n\r\n			<p style=\"text-align:justify\">(2) gaya coulomb sebanding dengan Q<sub>1</sub>&nbsp;dan Q<sub>2</sub></p>\r\n\r\n			<p style=\"text-align:justify\">(3) gaya coulomb berbanding terbalik dengan kuadrat jarak antara Q1 dan Q2</p>\r\n\r\n			<p style=\"text-align:justify\">(4) kuat medan listrik di tengah tengah antara Q1 dan Q2 nol</p>\r\n\r\n			<p style=\"text-align:justify\">Pernyataan yang benar adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('512', '23', '\r\n			<p style=\"text-align:justify\">Kuat medan listrik yang ditimbulkan oleh muatan listrik pada sebuah titik bergantung pada&hellip;.</p>\r\n\r\n			<p style=\"text-align:justify\">(1) besarnya muatan</p>\r\n\r\n			<p style=\"text-align:justify\">(2) jaraknya dari muatan</p>\r\n\r\n			<p style=\"text-align:justify\">(3) jenis muatan</p>\r\n\r\n			<p style=\"text-align:justify\">(4) jenis medium antara muatan dan titik</p>\r\n\r\n			<p style=\"text-align:justify\">Pernyataan di atas yang benar adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('513', '23', '\r\n			<p>Cecep memiliki sebuah baterai, sebuah ampermeter dan empat buah resistor dan dua buah saklar, kemudian Cecep merangkainya seperti gambar di bawah ini!</p>\r\n\r\n			<p><img id=\"Picture_x0020_13\" src=\"[base_url]uploads/mapel_23/64142d5bf3e68.png\" style=\"height:146.25pt; width:285pt\"></p>\r\n\r\n			<p>Kemudian Cecep menutup saklar no 1 dan membuka saklar no.2, maka pernyataan yang benar di bawah ini sesuai rangkaian cecep adalah&hellip;. .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('514', '23', '\r\n			<p style=\"text-align:justify\">Sebuah bola lampu listrik bertuliskan 220 V/50&nbsp;&Omega;. Pernyataan berikut yang benar adalah &hellip;..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('586', '12', '\r\n			<p>Perhatikan beberapa point di bawah ini!</p>\r\n\r\n			<ol><li>Yudikatif</li>\r\n				<li>Eksekutif</li>\r\n				<li>Moneter</li>\r\n				<li>Legislatif</li>\r\n				<li>Otokrasi</li>\r\n				<li>Publikasi</li>\r\n				<li>Federatif</li>\r\n			</ol><p>Yang merupakan pembagian kekuasaan menurut Montesquie adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('587', '12', '\r\n			<p style=\"text-align:justify\">Di Indonesia menggunakan konsep pemisahan kekuasaan negara menjadi beberapa Lembaga negara. Alasan paling tepat dilakukan pemisahan kekuasaan adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('588', '12', '\r\n			<p>Pancasila merupakan sendi utama yang digunakan sebagai pedoman pelaksanaan negara yang baik dan benar. Berikut ini yang merupakan bentuk pelaksanaan paling kongkrit dalam Pelaksanaan nilai-nilai Pancasila adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('589', '12', '\r\n			<p>Asas yang menentukan kewarganegaraan seseorang menurut pertalian darah atau yang menentukan kewarganegaraan seseorang ialah kewarganegaraan orang tuanya, dengan tidak mengindahkan di mana ia sendiri dan orang tuanya berada dan dilahirkan adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('590', '12', '\r\n			<p>Secara legal formal pencurian &nbsp;ikan oleh kapal asing di perairan Indonesia&nbsp; dapat dikategorikan kejahatan luar biasa. Paling utama: pelanggaran kedaulatan. Merujuk kepada Konvensi PBB tentang Hukum Laut 1982, masuknya kapal ikan asing secara ilegal di laut&nbsp; teritorial &nbsp;Indonesia &nbsp;dapat &nbsp;dikategorikan &nbsp;membahayakan &nbsp;kedamaian, ketertiban, atau keamanan nasional (Pasal 19). UU No 31/2004 yang diperbarui dengan UU&nbsp; No &nbsp;45/2009 tentang &nbsp;Perikanan &nbsp;menyebutkan, &nbsp;aksi pencurian &nbsp;ikan &nbsp;tergolong tindak pidana. Berdasarkan artikel di atas, <em>ilegal fishing </em>merupakan salah satu ancaman terhadap...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('591', '12', '\r\n			<p style=\"text-align:justify\">Batas lautan suatu negara pantai yang lebarnya 200 mil laut dari pulau terluar Indonesia dan dalam batas ini, negara Indonesia memiliki hak untuk segala kegiatan eksplorasi dan eksploitasi sumber daya alam permukaan laut, di dasar laut, dan di bawah laut serta mengadakan penelitian sumber daya hayati maupun sumber daya laut lainnya.disebut .....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('592', '12', '\r\n			<p>Contoh kerukunan hidup antarumat beragama dalam masyarakat antara lain ......</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('593', '12', '\r\n			<p>Perhatikan data berikut!</p>\r\n\r\n			<p style=\"text-align:justify\">(1).Menetapkan Undang-Undang Dasar dan mengubah Undang Undang Dasar,</p>\r\n\r\n			<p>(2).Menetapkan Garis-Garis Besar Haluan Negara</p>\r\n\r\n			<p>(3).Memilih Presiden dan Wakil Presiden,</p>\r\n\r\n			<p>(4).Menetapkan Undang-Undang Dasar dan/ Perubahan UUD,</p>\r\n\r\n			<p>(5).Melantik Presiden dan Wakil Presiden,</p>\r\n\r\n			<p style=\"text-align:justify\">(6).Memberhentikan Presiden dan/ Wakil Presiden</p>\r\n\r\n			<p style=\"text-align:justify\">Berdasarkan data diatas yang merupakan kewenangan Majelis Permusyawaratan Rakyat setelah diadakannya Perubahan UUD 1945 ditandai oleh nomor ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('594', '12', '\r\n			<p style=\"text-align:justify\">Lembaga yang wajib memberikan putusan atas pendapat DPR bahwa presiden dan/atau wakil presiden diduga, telah melakukan pelanggaran hukum berupa pengkhianatan terhadap negara, korupsi, penyuapan, dan tindak pidana berat lainnya, adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('595', '12', '\r\n			<p style=\"text-align:justify\">Setiap warga negara Indonesia memperoleh kesempatan yang sama untuk menduduki jabatan&nbsp; &nbsp;dalam&nbsp; &nbsp;pemerintahan.&nbsp; &nbsp;Bahkan,&nbsp;&nbsp; pekerja&nbsp; &nbsp;seni&nbsp; &nbsp;atau&nbsp; &nbsp;artis&nbsp; &nbsp;lomba-lomba untuk berpartisipasi dalam memperebutkan kursi di pemerintahan. Hal tersebut mengindikasikan salah satu ciri negara yang menganut sistem demokrasi, yaitu.....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('596', '12', '\r\n			<p>Pelimpahan wewenang oleh pemerintah pusat kepada daerah otonom sebagai wakil pemerintah atau perangkat pusat di daerah, ini dilaksanakan di negara kesatuan dengan sistem....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('597', '12', '\r\n			<p style=\"text-align:justify\">Konsekuensi logis ketentuan Pasal 18 Ayat (1) Undang-Undang Dasar Negara Republik Indonesia Tahun 1945 adalah adanya pembagian pemerintah antara pemerintah pusat dan pemerintah daerah. Pemerintah daerah diberi kewenangan untuk menjalankan seluruh urusan pemerintahan di daerah, yang menjadi kewenangan ranah pemerintah daerah, adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('598', '12', '\r\n			<p>UU RI No. 32 Tahun 2004 tentang Pemerintahan Daerah memberikan kewenangan kepada Pemerintah Daerah untuk menjalankan seluruh urusan pemerintahan di daerah, kecuali beberapa kewenangan yang menjadi ranah pemerintah pusat antara lain&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('599', '12', '\r\n			<p>Indonesia adalah negara yang sangat rentan akan terjadinya perpecahan dan konflik. Hal ini disebabkan ......</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('600', '12', '\r\n			<p>Momentum yang merupakan konsensus nasional yang merupakan konsep integrasi bangsa Indonesia menjadi suatu bangsa yang resmi dan berdaulat adalah...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('601', '12', '\r\n			<p style=\"text-align:justify\">Berikut yang bukan merupakan contoh wujud integrasi nasional adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('602', '12', '\r\n			<p style=\"text-align:justify\">Salah satu faktor penghambat integrasi nasional adalah adanya gerakan separatisme yaitu suatu gerakan yang bertujuan untuk mendapatkan kedaulatan dan memisahkan suatu wilayah atau kelompok manusia (biasanya kelompok dengan kesadaran nasional yang tajam) dari satu sama lain. Gerakan separatisme termasuk golongan ancaman&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('603', '12', '\r\n			<p>Pada hakikatnya wawasan nusantara adalah cara pandang bangsa Indonesia terhadap diri dan lingkungannya berdasarkan Pancasila dan UUD NRI Tahun 1945. Dengan demikian Fungsi wawasan nusantara adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('604', '12', '\r\n			<p style=\"text-align:justify\">Tindakan perilaku bangsa Indonesia dalam melaksanakan aspirasinya guna mewujudkan Indonesia sebagai satu kesatuan yang utuh menyeluruh dalam mencapai tujuan nasional merupakan pengartian dari&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('605', '12', '\r\n			<p style=\"text-align:justify\">Keberhasilan ketahanan nasional dapat dilihat dari beberapa aspek yang tercantum dalam asas ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('606', '12', '\r\n			<p style=\"text-align:justify\">Undang-Undang yang mengatur ihwal Hak Asasi Manusia yaitu UU &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('607', '12', '\r\n			<p>Contoh bentuk pertolongan yang sanggup dilakukan oleh warga masyarakat dalam upaya penegakan HAM yaitu ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('608', '12', '\r\n			<p>Berikut ini bukan merupakan tindakan pencegahan yang dapat dilakukan untuk pengatasi berbagai kasus pelanggaran HAM, yaitu &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('609', '12', '\r\n			<p>Pembredelan media massa pada masa Orde Baru merupakan pelanggaran hak warga negara dalam menyampaikan dan memperoleh informasi. Tindakan tersebut merupakan penyimpangan terhadap ketentuan jaminan hak asasi manusia dalam Undang-Undang Dasar Negara Republik Indonesia Tahun 1945 terutama dalam . . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('610', '12', '\r\n			<p>Sebagai negara hukum, Indonesia menempatkan semua manusia secara sama dimuka hukum. Hal ini tercemin dalam jaminan negara yang ditegaskan dalam Undang-Undang Dasar 1945 pada pasal&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('611', '12', '\r\n			<p>Hukum sebagai aturan tingkah laku para anggota masyarakat yang daya pengunaanya pada saat tertentu diindahkan oleh sustu masyarakat sebagai jaminan dari kepentingan bersama dan yang jika dilanggar menimbulkan reaksi bersama terhadap orang yang melakukannya, pengertian hukum tersebut diungkapkan oleh....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('612', '12', '\r\n			<p>Lembaga yang bersifat mandiri dan mempunyai wewenang mengusulkan hakim agung, menjaga dan menjalankan kehormatan, keluhuran, martabat para hakim adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('613', '12', '\r\n			<p>Setiap warga negara mempunyai kedudukan yang sama dalam hukum dan wajib menjunjung tinggi hukum yang berlaku. Sebagai seorang siswa yang memiliki kesadaran hukum sebaiknya&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('614', '12', '\r\n			<p>Dalam bidang budaya, kemajuan iptek dapat memberikan faktor pengaruh negatif dan juga pengaruh positif. Salah satu faktor pengaruh negatif dari kemajuan iptek adalah...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('615', '12', '\r\n			<p>Kemudahan masuknya informasi dari luar ke dalam negara indonesia disebabkan oleh peran teknologi dan informasi, hal berikut merupakan dampak iptek di bidang...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('616', '12', '\r\n			<p>Salah satu bentuk pengaruh positif Iptek untuk kepentingan penegakkan hukum adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('617', '12', '\r\n			<p>Seorang&nbsp;<em>Youtuber&nbsp;</em>yang berlatar belakang penari selalu mengunggah kegiatan menari yang dilakukannya, baik itu latihan, mengisi acara atau mengikuti perlombaan. Karena videonya tersebut bagus dan menarik, banyak orang yang menontonnya. Hal itu menyebabkan ia mendapatkan penghasilan tambahan dari hasil mengunggah video. Pengaruh positif kemajuan Iptek tersebut berhasil menghubungkan dua (2) aspek, yaitu ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('618', '12', '\r\n			<p>Dampak tidak&nbsp;adanya persatuan&nbsp;dan&nbsp;kesatuan dalam&nbsp;kehidupan berbangsa&nbsp;dan bernegara adalah . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('619', '12', '\r\n			<p>Sikap sebagai pernyataan rasa cinta terhadap persatuan dan kesatuan dalam hidup bermusyawarah dapat diwujudkan dengan cara ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('620', '12', '\r\n			<p>Upaya membina persatuan dan kesatuan dalam kehidupan sehari hari antara lain....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('621', '12', '<p>Indonesia membagi kekuasaan negaranya secara Horizontal dan Vertikal. Sebutkan dan jelaskan konsep pembagian kekuasaan di Indonesia secara Horizontal!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('622', '12', '<p>Pada hakikatnya dalam rangka pembentukan integrasi nasional, biasanya mengandalkan persatuan dan kesatuan masyarakat yang secara etnis majemuk sifat-sifat kebudayaan yang berbeda. Berdasarkan hal tersebut sebutkan perbedaan faktor pendorong&nbsp; dan faktor penghambat tercapainya integrasi nasional!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('623', '12', '<p>Wawasan nusantara terbentuk dari trigatra dan pancagatra. Coba sebutkan dari unsur-unsur Pancagatra!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('624', '12', '<p>Sebutkan dan jelaskan macam-macam sumber hukum formal!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('625', '12', '<p>Sebutkan dampak positif pengaruh kemajuan ilmu pengetahuan dan teknologi kehidupan bermasyarakat, berbangsa dan bernegara di Indonesia dalam aspek politik, ekonomi, social budaya dan pertahanan keamanan!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('666', '35', '\r\n			<p>Perhatikan Q.S. al-Isra&rsquo;/17: 32,berikut ini!</p>\r\n\r\n			<p><img id=\"_x0000_i1025\" src=\"[base_url]uploads/mapel_35/6417df1d8e042.png\" style=\"height:36pt; width:279.75pt\"></p>\r\n\r\n			<p>Arti dari ayat yang bergaris bawah adalah &hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('667', '35', '\r\n			<p>Perhatikan Q.S. Al-Baqarah/2 : 83 berikut ini :</p>\r\n\r\n			<p><img id=\"Picture_x0020_1\" src=\"[base_url]uploads/mapel_35/6417df1db33b8.png\" style=\"height:44.25pt; width:264pt\"></p>\r\n\r\n			<p>Isi kandungan ayat tersebut adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('668', '35', '\r\n			<p>Perhatikan Q.S. Luqman/31 : 13 berikut ini:</p>\r\n\r\n			<p><img id=\"Picture_x0020_3\" src=\"[base_url]uploads/mapel_35/6417df1dd9b46.png\" style=\"height:32.25pt; width:411pt\"> Isi kandungan ayat tersebut adalah sebagai berikut, kecuali&hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('669', '35', '\r\n			<p>Dalam segala keterbatasan ekonomi, seorang tukang becak sangat gigih dalam memperjuangkan kesuksesan untuk meraih pendidikan anaknya, sehingga anaknya berhasil meraih gelar Doktor dari UGM. Hal ini merupakan cerminan salah satu Asmaul Husna....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('670', '35', '\r\n			<p>Pernyataan berikut yang merupakan perbedaan malaikat, jin dan manusia adalah.....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('671', '35', '\r\n			<p>Allah menurunkan kitab-kitab-Nya dengan bahasa kaum dari Nabi yang diutusnya. Diantara kitab yang diturunkan Allah dengan bahasa Ibrani adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('672', '35', '\r\n			<p>Perhatikan pernyataan berikut ini :</p>\r\n\r\n			<ol><li>Membenarkan Rasul Allah SWT yang selalu bersifat amanah</li>\r\n				<li>Memiliki sifat sabar ketika mendapatkan ujian dan mampu bersyukur ketika mendapatkan kenikmatan</li>\r\n				<li>Hidup mengalir saja tanpa arah dan tujuan yang jelas</li>\r\n				<li>Istiqamah dan konsisten memperjuangkan keadilan</li>\r\n				<li>Meyakini kekujuran yang yang dimiliki Rasul-rasul Allah SWT</li>\r\n			</ol><p>Pernyataan yang menunjukan&nbsp; makna keimanan kepada Rasul-rasul Allah SWT .adalah . . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('673', '35', '\r\n			<p>Perhatikan pernyataan berikut ini :</p>\r\n\r\n			<ol><li>Keluarnya Dajjal</li>\r\n				<li>Adanya perilaku pria menyerupai wanita dan wanita menyerupai pria</li>\r\n				<li>Adanya Ya&rsquo;juj dan Ma&rsquo;juj</li>\r\n				<li>Negara Arab menjadi padang rumput dan sungai</li>\r\n				<li>Adanya orang yang baik berkurang sedang yang jahat bertambah banyak</li>\r\n			</ol><p>Pernyataan yang <strong><em>tidak</em></strong> menunjukan&nbsp; tanda tanda&nbsp; kiamat sughro adalah . . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('674', '35', '\r\n			<p>Iman kepada qadha&rsquo; dan qodar berarti meyakini dengan sepenuh hati bahwa segala sesuatu itu benar-benar berjalan diatas takdir Allah SWT.</p>\r\n\r\n			<p>Berikut ini perilaku yang mencerminkan iman kepada qadha dan qadar, <strong><em>kecuali</em></strong>... .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('675', '35', '\r\n			<p>Berikut ini contoh taqdir dan usaha dengan bijak &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('676', '35', '\r\n			<p>Perhatikanlah contoh kasus di bawah ini!</p>\r\n\r\n			<ol><li>Diana berangkat kerja dengan memakai seragam, rok pendek dan berjas.</li>\r\n				<li>Ali berangkat sekolah dengan berseragam, celana panjang dan mengenakan baju lengan pendek.</li>\r\n				<li>Shafiyah bersepeda dengan mengenakan kostum olah raga, memakai celana panjang kaos lengan panjang dan berjilbab</li>\r\n				<li>Burhan mengikuti pertandingan sepak bola dengan mengenakan kostum celana pendek dan kaos.</li>\r\n				<li>Hena berangkat ke pasar dengan mengenakan celana pendek dan kaos lengan panjang</li>\r\n			</ol><p>Dari kasus di atas, manakah yang menunjukan contoh berpakaian menurut syariat Islam?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('677', '35', '\r\n			<p>Saat Amir membeli alat tulis ada orang buta menukarkan uang Rp. 100.000,- Amir pun langsung menukarkan dengan uang Rp. 50.000,- dua lembar.&rdquo;</p>\r\n\r\n			<p>Perilaku Amir pada kutipan cerita tersebut adalah..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('678', '35', '\r\n			<p>Sabda Rasullullah SAW &ldquo;Sampaikanlah olehmu (apa-apa yang telah kamu peroleh) daripadaku walaupun hanya satu ayat Al-Qur&rsquo;an\".</p>\r\n\r\n			<p>Kandungan makna hadist di atas adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('679', '35', '\r\n			<p>Pak Arman, seorang tukang kebun yang tegas dan berani. Ketika ada orang yang berbuat salah meskipun orang tersebut adalah pimpinanya dia tetap mengingatkannya.</p>\r\n\r\n			<p>Perilaku Pak Arman yang demikian termasuk perwujudan dari sikap...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('680', '35', '\r\n			<p>Sering seorang siswa membeda-bedakan fungsi antara orang tua dan guru, padahal fungsi keduanya hampir sama. Di bawah ini adalah fungsi orang tua dan guru yang sama, kecuali...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('681', '35', '\r\n			<p>Disaat teman-temannya liburan Zidan menggunakan waktunya untuk belajar, sehingga dia berhasil memperoleh nilai UN tertinggi tingkat nasional.</p>\r\n\r\n			<p>Perilaku tersebut merupakan manfaat dari&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('682', '35', '\r\n			<p>Saiful bercita-cita ingin menjadi seorang Kepala Desa. Untuk mencapai cita-citanya, dia harus berusaha dan bekerja keras dengan penuh tanggung jawab dalam kehidupan sehari- hari.</p>\r\n\r\n			<p>Berikut ini yang <strong>tidak</strong> termasuk prinsip sikap kerja keras dan tanggung jawab yang harus dimiliki oleh Saiful dalam mencapai mimpi dan cita-citanya adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('683', '35', '\r\n			<p>Akhir-akhir ini semangat berkompetisi sangat menurun di kalangan pelajar. Ini dibuktikan ketika diumumkan tentang peringkat kelas, justru sang juara menjadi cemoohan teman-temannya yang lain. Mereka menanggapinya dengan sinis bahwa si juara ini pelit orangnya, tidak mau bagi-bagi pada saat ujian.</p>\r\n\r\n			<p>Yang harus dilakukan oleh orang yang memahami isi Q.S. al-M&Auml;&#129;idah/5:48 adalah .&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('684', '35', '\r\n			<p>Hadis sebagai sumber hukum Islam berada satu tingkat di bawah Al Qur&rsquo;an. Artinya jika ada perkara hukum yang tidak terdapat dalam Al Qur&rsquo;an maka sandaran berikutnya adalah hadis. Berikut kedudukan hadis yang <strong>tidak</strong> sesuai sebagai sumber hukum Islam adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('685', '35', '\r\n			<p>Wakaf merupakan amal jariyah yang pahalanya akan terus mengalir meskipun yang mewakafkan sudah meninggal dunia. Namun demikian wakaf belum banyak dilaksanakan oleh umat Islam. Hal ini di karenakan kecintaan yang besar terhadap dunia.</p>\r\n\r\n			<p>Berikut ini yang <strong>tidak termasuk</strong> hikmah dan manfaat ibadah wakaf adalah... .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('686', '35', '\r\n			<p>Dalam pelaksanaan sholat jenazah anatara laki-laki dan perempuan berbeda. Ketika jenazah laki-laki mau dishalatkan maka letak imam dalam shalatnya adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('687', '35', '\r\n			<p>Ketika seseorang meninggal dunia salah satu hal yang dianjurkan adalah untuk segera dilaksanakan rangkaian perawatan jenazah.</p>\r\n\r\n			<p>Hikmah dari menyegerakan pelaksanan perawatan jenazah adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('688', '35', '\r\n			<p>Allah memerintahkan kepada Rasulnya untuk menyeru manusia ke jalan Allah dengan cara yang penuh hikmah dan bijaksana.</p>\r\n\r\n			<p>Berikut ini termasuk etika berdakwah adalah, <strong>kecuali</strong>&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('689', '35', '\r\n			<p>Seiring dengan perkembangan jaman Jual beli sering kali tidak memenuhi ketetentuan yang sudah di syariatkan dalam Islam. Di era milenial transaksi ekonomi berbasis <em>online</em> menjadi salah satu pilihan alternatif&nbsp; dalam melakukan transaksi. Transaksi dinyatakan&nbsp; sah apabila memenuhi&nbsp; rukun&nbsp; jual beli antara lain, <strong>kecuali</strong>...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('690', '35', '\r\n			<p>Yazid seorang pemuda dewasa dan matang secara mental yang sudah memiliki kemapanan dari sisi ekonomi. Akan tetapi, dia khawatir terjerumus dalam perbuatan zina bila tidak segera menikah. Dari ilustrasi tersebut hukum menikah bagi Yazid adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('691', '35', '\r\n			<p>Pak Fatoni dan Bu Fatonah, pasangan yang sudah menikah selama 15 tahun akan tetapi, belum mendapatkan keturunan. Meskipun demikian mereka tetap rukun, karena mereka menyadari besarnya hikmah pernikahan.</p>\r\n\r\n			<p>Berikut ini yang <strong>bukan</strong> merupakan hikmah nikah adalah, &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('692', '35', '\r\n			<p>Penghalang bagi ahli waris untuk menerima warisan karena ada ahli waris yang&nbsp; Lebih dekat disebut ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('693', '35', '\r\n			<p>Dalam sejarah sudah dijelaskan bahwa dakwah Rasulullah SAW periode Mekah mengalami banyak pertentangan dari kaum kafir Quraisy. Dengan demikian hasil dakwah Rasulullah SAW di Mekah bisa dikatakan kurang maksimal. Akhirnya Rasulullah SAW mengambil tindakan yang merupakan solusi dari permasalahan yang dihadapi.</p>\r\n\r\n			<p>Berikut ini&nbsp; tindakan yang diambil Rasulullah SAW untuk mencari solusi dari permasalahan dakwah&nbsp; di Mekah &hellip;.&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('694', '35', '\r\n			<p>Orang-orang Mekah telah membatalkan secara sepihak Perjanjian Hudaibiyah. Oleh karena itu, Nabi Muhammad saw. segera berangkat ke Mekah dengan 10.000 orang tentara. Tanpa kesulitan, Nabi dan pasukannya memasuki Mekah dan berhala-berhala di seluruh sudut negeri dihancurkan. Setelah itu Nabi berkhutbah memberikan pengampunan bagi orang-orang Quraisy. Pristiwa trsbut diknal dngan&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('695', '35', '\r\n			<p>Hadirnya kerajaan Mughal di India membentuk sebuah peradaban baru yang mampu membangkitkan semangat umat Islam di India. Hal tersebut mampu mewarnai perkembangan Islam pada saat itu dan dapat kita ambil pelajaran untuk kebangkitan Islam di periode berikutnya.</p>\r\n\r\n			<p>Diantara peninggalan dari kerajaan Mughal antara lain &hellip;&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('696', '35', '\r\n			<p style=\"text-align:justify\">Perhatikan tabel berikut!</p>\r\n\r\n			<p style=\"text-align:justify\"><img id=\"Picture_x0020_2\" src=\"[base_url]uploads/mapel_35/6417df2309463.png\" style=\"height:138pt; width:390pt\"></p>\r\n\r\n			<p>Pasangan tokoh dengan hasil karyanya yang benar adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('697', '35', '\r\n			<p>Dalam proses penyebaran Agama Islam di Indonesia sangatlah mudah diterima oleh masyarakat. Dibawah ini yang <strong>tidak</strong> termasuk strategi penyebaran dakwah Islam di Indonesia adalah . . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('698', '35', '\r\n			<p>Salah satu cara penyebaran agama Islam di Indonesia yaitu melalui proes asimilasi media&nbsp; kesenian&nbsp; misalnya, gamelan, wayang dan tembang Jawa, seni tari dan seni musik. Para wali mahir dalam mementaskan wayang, beliau tidak pernah meminta upah materi dalam setiap pertunjukan yang dilakukannya. Beliau hanya meminta kepada penonton untuk mengikutinya dengan mengucap dua&nbsp; kalimat syahadat.</p>\r\n\r\n			<p>Faktor-faktor yang mempengaruhi perkembangan Islam tersebut adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('699', '35', '\r\n			<p>Pada masa Dinasti Bani Umayah peradaban Islam mengalami kejayaan. Kejayaan peradaban Islam pada masa itu dipengaruhi oleh faktor internal dan eksternal.</p>\r\n\r\n			<p>Berikut ini yang <strong>bukan</strong> merupakan faktor internal adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('700', '35', '\r\n			<p>Tradisi ilmiah dan perkembangan peradaban Islam merambah Eropa melalui Spanyol selanjutnya menyebar ke berbagai negara Eropa lainnya. Beragam kajian dan forum ilmiah dilakukan di berbagai kota, sementara itu Spanyol menjadi kota yang sangat mengesankan dan menjadi bukti kebesaran Islam di Eropa.</p>\r\n\r\n			<p>Berikut ini yang merupakan bukti perkembangan Islam di Eropa yakni ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('701', '35', '\r\n			<p>Nama-nama yang baik dan indah yang hanya dimiliki oleh Allah Swt. sebagai bukti keagungan-Nya. Nama-nama Allah Swt. yang agung dan mulia itu merupakan suatu kesatuan yang menyatu dalam kebesaran dan keagungan-Nya disebut...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('702', '35', '\r\n			<p>Sejak turun wahyu surah Al Muddasir [74]: 1-7 Rasullullah SAW. memulai untuk berdakwah. Sasaran dakwah Rasululullah SAW. awalnya adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('703', '35', '\r\n			<p>Berdasarkan hukum Islam, perzinaan termasuk salah satu dosa besar,zina adalah dosa besar ke tiga setelah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('704', '35', '\r\n			<p>Untuk menyeleksi kebenaran suatu hadits harus memperhatikan 3 unsur yaitu &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('705', '35', '\r\n			<p>Kesepakatan para mujtahid untuk memutuskan suatu perkara baru yang tidak dijumpai hukumnya dalam Al-Qur&rsquo;an maupun Al-Hadits dinamakan &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('706', '35', '<p>Sebutkan Rukun Islam &amp; Rukun Iman dengan urutan yang benar dan lengkap!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('707', '35', '<p>Apa perbedaan dari &nbsp;Al qur an dan al hadits ?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('708', '35', '<p>apa pengertian dari wakaf menurut bahasa dan menurut istilah ?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('709', '35', '<p>Ikhsan adalah berbuat kebaikan kepada Alloh SWT maupun kepada makhlukNya. Kepada makhluk Alloh siapa saja kita harus berbuat ikhsan ? (sebutkan 5 macam);</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('710', '35', '<p>Menurut hadits Nabi Muhammad saw. Wanita itu dinikahi biasanya karena 4 hal. Sebutkan !&nbsp;</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('711', '13', '\r\n			<p>Cermati ilustrasi berikut ini!</p>\r\n\r\n			<p>Mereka tetap &hellip; dalam persoalan itu sehingga hal tersebut sulit diungkap.</p>\r\n\r\n			<p>Ungkapan yang tepat untuk melengkapi kalimat tersebut adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('712', '13', '\r\n			<p>Bacalah Jenderal Sudirman adalah tokoh yang sangat dikenal dalam sejarah Indonesia. Kita mengenal Jenderal Sudirman sebagai panglima angkatan bersenjata yang berjuang dengan mengorbankan jiwa, raga, dan harta. Namanya tetap dikenal dengan diabadikan sebagai nama jalan di berbagai kota, wajahnya pun pernah menghias uang kertas dan uang logam. Patung dirinya juga dapat dilihat di Jalan Jenderal Sudirman Jakarta dan di depan gedung DPRD Yogyakarta.</p>\r\n\r\n			<p>Gagasan utama bacaan di atas adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('713', '13', '\r\n			<p><em>Cermati penggalan &nbsp;berikut!</em></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Aku rindu senyummu</p>\r\n\r\n			<p>Aku rindu&nbsp; kasih sayangmu</p>\r\n\r\n			<p>Aku rindu cintamu</p>\r\n\r\n			<p>Sekarang dan esok</p>\r\n\r\n			<p>Di saat hujan atau gerimis</p>\r\n\r\n			<p>Selamanya....</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Penggalan puisi tersebut menggunakan majas ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('714', '13', '\r\n			<p>Perhatikan ilustrasi berikut dengan saksama!</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Sebagai panglima dan pejuang, Cut Nyak Dien tidak pernah gentar menghadapi lawan yang persenjataannya modern. Bagi pejuang ini, hidup dan mati di tangan Allah.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Peribahasa yang sesuai untuk ilustrasi tersebut adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('715', '13', '\r\n			<p>Bacalah penggalan penggalan novel berikut ini!</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Sabtu malam, sebetulnya aku berniat begadang di klinik. Tapi dokter yang datang menepati janji menganjurkan agar aku istirahat di rumah saja. &ldquo;Belum saatnya keluar,&rdquo; kata dokter. &ldquo;Mungkin dua atau tiga hari lagi,&rdquo;. Ajurannya kuanggap masuk akal.</p>\r\n\r\n			<p style=\"text-align:justify\">(<em>Ranjang Bayi</em>, N. Riantiarno)</p>\r\n\r\n			<p>Nilai yang terdapat dalam penggalan novel tersebut adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('716', '13', '\r\n			<p>Cermati penggalan novel berikut!</p>\r\n\r\n			<p style=\"text-align:justify\">Alkisah, pada zaman dahulu, di negeri Arab, hiduplah seorang pemimpin kabilah, seorang Sayid, yang sangat termasyhur. Bani Amir, nama kabilah itu. Tidak ada seorang pun yang dapat menandingi kekayaan dan kejayaan sang Sayid itu. Kegagahberaniannya telah termasyhur di seluruh Jazirah Arab.Kedermawanannya kepada fakir miskin dan keramahtamahannya kepada para musafir terkenal di mana-mana. Namun, ia selalu sedih karena tak memiliki anak. (<em>Laila Majnun</em> karya Nizami)</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Tahapan alur penggalan novel di atas adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('717', '13', '\r\n			<p>Bacalah petunjuk kerja berikut dengan cermat!</p>\r\n\r\n			<ul><li>Petunjuk Membuka Sistem Operasi Teks</li>\r\n				<li style=\"text-align:justify\">Tekan tombol <em>Power </em>pada CPU.</li>\r\n				<li style=\"text-align:justify\">Masukkan <em>password </em>jika komputer tersebut meminta Anda memasukkan <em>password.</em></li>\r\n				<li style=\"text-align:justify\">Kemudian, komputer akan menampilkan halaman depan (<em>dekstop</em>).</li>\r\n				<li style=\"text-align:justify\">Klik tombol <em>start, </em>lalu pilihlah <em>All Program. </em>Lanjutkan dengan memilih <em>Accesories, </em>lalu pilih <em>Comamand Prompt.</em></li>\r\n				<li style=\"text-align:justify\">Selanjutnya, Anda akan melihat tampilan <em>MS-DOS.</em></li>\r\n				<li style=\"text-align:justify\">Jika keluar dari <em>MS-DOS, </em>ketiklah <em>Exit, </em>lalu tekan tombol<em> Enter.</em></li>\r\n			</ul><p style=\"text-align:justify\">Pernyataan berikut yang <em>tidak sesuai</em> dengan petunjuk kerja di atas adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('718', '13', '\r\n			<p style=\"text-align:justify\">(1) Untuk menjaga kesehatan, Wijaya mengonsumsi pangan organik sejak 1998 hingga kini. (2) Gaya hidup organik ini terus berkembang dan meluas setelah gencarnya kampanye makanan organik. (3) Pada umumnya, para pelaku mendambakan hidup lebih sehat. (4) Seorang warga Sunter, Jakarta Utara yang menikmati pangan organik sejak 2004 mengatakan ingin menjalani hidup sehat. (5) Sebelum makan makanan organik, saya sering pilek dan batuk, setidaknya sebulan sekali, tetapi setelah mengonsumsi hampir tidak pernah lagi.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Simpulan bacaan tersebut adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('719', '13', '\r\n			<p>Cermatilah catatan hasil rapat berikut ini!</p>\r\n\r\n			<ul><li>Siswa kelas XI &nbsp;Jurusan Animasi wajib mengikuti kunjungan industri.</li>\r\n				<li>Kunjungan industri akan dilaksanakan minggu terakhir bulan Januari 2019.</li>\r\n				<li>Semua siswa harus membuat laporan hasil kunjungan industri.</li>\r\n				<li>Siswa yang tidak mengikuti kunjungan industri diharuskan mengadakan kunjungan industri sendiri.</li>\r\n				<li>Seyogyanya, nilai laporan hasil kunjungan industri dimasukkan ke dalam nilai mata pelajaran produktif yang relevan.</li>\r\n			</ul><p>Kalimat hasil rapat yang berupa saran ditandai dengan nomor&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('720', '13', '\r\n			<p>Bacalah penggalan kata pengantar berikut ini!</p>\r\n\r\n			<p>Karya tulis ini penulis buat berdasarkan hasil praktik kerja industri selama enam bulan di Hotel Makin Cantik,&nbsp; Jakarta Selatan. Adapun, uraian kegiatan dalam karya tulis ini secara teknis penulis bagi menjadi dua bagian, yakni uraian kegiatan selama empat bulan praktik <em>house</em>&nbsp; <em>keeping</em> dan tiga bulan praktik di <em>front office</em>.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Inti penggalan kata pengantar di atas adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('721', '13', '\r\n			<p>Bacalah paragraf berikut dengan saksama!</p>\r\n\r\n			<p>Slamet Rony mengaku urusannya baru lancar setelah memberi uang rokok atau pelicin kepada ketua RT. (2) Hal inilah yang mengejutkan Eky Triatman. (3) Eky Triatman mengaku sudah dua hari berkasnya terhenti di tangan ketua RT. (4) Keduanya sepakat menemui ketua RT demi kelancaran surat pengantar Eky Triatman tersebut. (5) Belum sempat menuju ke rumah RT, tiba-tiba, ketua RT datang sambil menyerahkan surat pengantar yang diharapkan.</p>\r\n\r\n			<p>Kata yang berkonotasi negatif dalam paragraf di atas terdapat pada kalimat nomor&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('722', '13', '\r\n			<p>Bacalah ilustrasi berikut dengan saksama!</p>\r\n\r\n			<p>Sebagai orang yang berasal dari desa, Sonny Kaelani memutuskan kembali ke desa setelah pensiun. Baginya, kota semakin padat dan terasa <em>sumpek</em>. Kegemarannya menanam akan kembali ia buktikan. Di angan-angannya, &nbsp;sudah ada setumpuk keinginan yang segera diwujudkan. Dua tahun kemudian, semua yang ia tanam sudah membuahkan hasil seperti yang diobsesikan.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Ungkapan yang tepat untuk menggambarkan kesuksesan Sonny Kaelani dalam bertanam adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('723', '13', '\r\n			<p>Cermati kutipan lirik lagu berikut!</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Kutahu kamu pasti merasa apa yang kurasa</p>\r\n\r\n			<p>Pantasnya kamu mencintai yang juga cintai dirimu</p>\r\n\r\n			<p>Cinta kamu</p>\r\n\r\n			<p><em>Reff</em></p>\r\n\r\n			<p>Lepaskanlah ikatanmu dengan aku biar kamu senang</p>\r\n\r\n			<p>Bila berat melupakan aku pelan-pelan saja&hellip;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Makna ungkapan &ldquo;Lepaskanlah ikatanmu&rdquo; yang terdapat dalam lirik lagu di atas adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('724', '13', '\r\n			<p>Bacalah puisi berikut dengan saksama!</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Dia yang gentayangan di jalan malam</p>\r\n\r\n			<p>Tergoda pada megah perempuan</p>\r\n\r\n			<p>Tetapi selalu berujung pada ketidakberdayaan</p>\r\n\r\n			<p>Dan Tuhan? Selalu hadir tepat pada saat dibutuhkan</p>\r\n\r\n			<p>Bahkan Si Penggoda yang merasa pongah</p>\r\n\r\n			<p>Ini gagah berjalan di jalan-jalan yang salah</p>\r\n\r\n			<p>Dia terima, menjelma jadi kurcaci di telapak tangan-Nya</p>\r\n\r\n			<p>Diberinya kehangatan, lalu dia pulang pada ketentraman &hellip;</p>\r\n\r\n			<p style=\"text-align:center\">Oleh: Abdul Wachid B. S</p>\r\n\r\n			<p>Tema puisi tersebut adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('725', '13', '\r\n			<p>Cermati kalimat poster berikut dengan saksama!</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Tingkatan budaya membaca melalui perpustakaan keliling yang ada</strong><strong>.</strong></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Maksud yang terkandung pada poster tersebut adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('726', '13', '\r\n			<p>(1) Tujuan pembangunan akan berdaya guna dan berhasil guna jika direncanakan dan dilaksanakan secara sinergis. (2) Industri pariwisata difokuskan pada potensi alam, adat istiadat, kesenian, dan religi (3) Dalam adat istiadat, masyarakat&nbsp; memiliki budaya yang beragam di kawasan nusantara. (4) Indonesia dengan penduduknya yang berjumlah lebih dari 200 juta jiwa, terdiri atas 200 kelompok etis jelas memiliki kekayaan seni tradisi yang sangat banyak sekali. (5) Sekitar tiga perempat dari seluruh seni pertunjukan yang ada di Asia Tenggara terdapat di Indonesia.</p>\r\n\r\n			<p style=\"text-align:justify\">Kalimat tidak efektif terdapat dalam paragraf tersebut ditandai dengan nomor &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('727', '13', '\r\n			<p>Bacalah paragraf berikut dengan saksama!</p>\r\n\r\n			<p style=\"text-align:justify\">Vegetarian lebih jarang menderita kanker dibanding dengan orang yang tidak mengatur pola makannya karena pola makan sangat berpengaruh terjadinya kanker. 2) Sebuah studi yang dilakukan di Jerman menunjukkan bahwa kematian akibat kanker pada seorang vegetarian lebih rendah 52% dan pada wanita 26% dibandingkan populasi pada umumnya. 3) Semakin lama seseorang menjadi vegetarian, efek untuk mengalami penyakit kanker akan semakin berkurang. 4) Rendahnya risiko kanker pada seorang vegetarian berkaitan dengan dua hal, yaitu vegetarian tidak mengonsumsi daging terutama daging merah dan mengonsumsi bahan makanan nabati seperti sayuran dan buah.5) Makanan yang berasal dari tumbuhan, baik sayur, buah, maupun kacang-kacangan yang dikonsumsi oleh seseorang, mampu melindunginya dari kanker.</p>\r\n\r\n			<p style=\"text-align:justify\">Gagasan utama paragraf tersebut adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('728', '13', '\r\n			<p>Krisis keuangan&nbsp; mirip dengan penyakit manusia. Pada saat obat ditemukan untuk sebuah penyakit, penyakit lain yang belum ada obatnya sudah muncul. Beberapa penyakit yang semula belum ada obatnya dengan sangat mudah dilakukan tindakan preventifnya, yaitu dengan vaksinasi dan diagnosis diri. Jika manusia tetap terjangkiti, obatnya pun telah tersedia. Akan tetapi, lain halnya jika penyakitnya relatif baru dan belum ada obatnya ataupun prosedur pengobatannya.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Kalimat utama paragraf tersebut terdapat pada kalimat ke-&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('729', '13', '\r\n			<p>Salah satu hal yang memengaruhi &hellip; seseorang adalah &hellip; kerja karena dengan dorongan tersebut seseorang menjadi berhasil.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Kata-kata yang tepat untuk melengkapi kalimat tersebut adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('730', '13', '\r\n			<p>Pada dasarnya, manusia berkeinginan untuk dekat dengan alam dan hal ini diimplementasikan dengan taman (1). Arsitekstur senior dari Urbane Indonesia,&nbsp;&nbsp;&nbsp; M. Ridwan Kamil, telah mengadakan penelitian tentang hal itu (2). Taman dengan desain rindang cenderung memiliki banyak jenis tanaman (3). Dengan demikian, tanaman tersebut menghasilkan bunga warna-warni yang sedap dipandang mata (4). Itulah sebabnya, taman dengan konsep&nbsp; tersebut diakui banyak orang lebih indah untuk dipandang (5).</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Kalimat yang berbentuk fakta dalam bacaan tersebut ditandai dengan nomor&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('731', '13', '\r\n			<p><strong><em>Cermati grafik berikut ini !</em></strong></p>\r\n\r\n			<p style=\"text-align:justify\"><img id=\"Chart_x0020_3\" src=\"[base_url]uploads/mapel_13/6417e4ae7546d.png\" style=\"height:113.25pt; width:324pt\"></p>\r\n\r\n			<p style=\"text-align:justify\">Dari grafik di atas, dapat disimpulan bahwa &hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('732', '13', '\r\n			<p>Saudara-saudara, ada ungkapan yang mengatakan bahwa penulis tidak pernah dilahirkan, tetapi diciptakan. Ungkapan tersebut mengandung makna bahwa penulis sebenarnya bukan persoalan bakat seseorang sejak lahir, melainkan persoalan minat dan motivasi serta latihan yang gigih. Jadi, semua orang mampu menjadi penulis, asal motivasi, kegigihan, serta berlatih kuat. Kegagalan berkali-kali dalam menulis bukanlah alasan yang tepat untuk segera menguburkan keinginan menjadi penulis.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Simpulan yang tepat dari isi pidato tersebut adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('733', '13', '\r\n			<p>Bacalah paragraf di bawah ini!</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Dalam pemilihan susu pun, orang tua acapkali dibingungkan dengan banyaknya susu di pasaran yang menawarkan banyak keunggulan. Mulai dari yang baik untuk kesehatan pencernaan hingga baik untuk perkembangan otak. ... Namun, yang terpenting tentunya kesehatan. &nbsp;&ldquo;Sehat&rdquo;&nbsp; menawarkan kedua-duanya.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p>Kalimat yang sesuai untuk melengkapi paragraf di atas adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('734', '13', '\r\n			<p>Adegan menarik dari bagian ini adalah saat mereka berdua hendak menonton film bioskop dan harus terpisah tempat duduknya karena peraturan yang berlaku. Johan duduk di bagian kulit putih, sementara Oeroes kulit berwarna, yang tempatnya di balik layar sehingga gambar film yang ditonton terbalik. Sebelum sampai ke gedung bioskop, Oeroes sempat mengalami hinaan dari orang sekaumnya karena pakaian dan lagak lagunya yang &ldquo;putih&rdquo;.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Pernyataan yang sesuai dengan isi paragraf tersebut adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('735', '13', '\r\n			<p>Andrea Hirata, lahir di Belitung. Meskipun studi mayornya ekonomi, ia amat menggemari sains, fisika, kimia, biologi, astronomi, dan tentu saja sastra. Andre berpendidikan ekonomi dari UI. Ia mendapat beasiswa Uni Eropa untuk studi <em>master of science</em> di Universitas de Paris, Sorbonne, Perancis dan Shiffield&nbsp; Hallam University, United Kingdom. Saat ini, penulis novel <em>Laskar Pelangi</em> itu tinggal di Bandung dan bekerja di kantor pusat PT Telkom. Hobinya naik komidi putar.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Berdasarkan bacaan tersebut, bidang yang <em>tidak digeluti</em> Andre Hirata adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('736', '13', '\r\n			<p>Terpilihnya Barack Obama sebagai Presiden AS ke-44, Rabu (5/11/2008), menjadikan Michelle La Vaughn Robinson Obama (44) sebagai perempuan kulit hitam pertama yang menjadi Ibu Negara AS. Istri Obama ini lahir di Chicago, Illionis, 17 Januari 1964. Ia merupakan doktor hukum dari Harvad serta sarjana sosiologi dari Princeton University. Terakhir, Michelle bekerja pada University of Chicago Hospital. Michelle menikah dengan Obama sejak tahun 1992 dan telah melahirkan dua putri, Sasha (6) dan Malia (9). Karier Michelle sama baiknya dengan Obama, seperti lazimnya pasutri bekerja,&nbsp; mereka kompak membagi tugas dan selalu mencuri&nbsp; waktu untuk dapat bersama. Pekerjaanlah yang mempertemukan mereka. Keduanya berkenalan saat sama-sama bekerja di Firma Hukum Sidley Austin di Chicago di mana perempuan cerdas ini bergaji 300.000 USD per tahun.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Pernyataan yang <em>tidak sesuai</em> dengan penggalan biografi di atas adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('737', '13', '\r\n			<p>Bacalah paragraf berikut dengan cermat !</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p>Akhir Januari 2004, Departemen Perhubungan memutuskan mengimpor gerbong KRL dari Jerman. Impor itu sebagai syarat utama yang harus dipenuhi Indonesia guna mendapatkan pinjaman dari negara tersebut bagi pembangunan infrastruktur penunjang dan perbaikan fasilitas transportasi perkeretaapian di wilayah Jabodetabek. Selain itu, PT KA juga merencanakan mengimpor 16 gerbong KRL bekas dari Jepang. Ke-16 gerbong itu telah tiba dan mulai&nbsp; dioperasikan melayani angkutan penumpang di Jabodetabek.</p>\r\n\r\n			<p style=\"text-align:justify\">Kalimat tanya yang jawabannya <em>tidak terdapat</em> dalam kutipan di atas adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('738', '13', '\r\n			<p>Untuk mengatasi jalan-jalan yang macet akan diadakan perubahan jalan.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Kalimat tersebut mengandung kesalahan nalar. Kalimat perbaikan yang efektif adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('739', '13', '\r\n			<p>Cermati petunjuk penggunaan berikut ini!</p>\r\n\r\n			<ol><li style=\"text-align:justify\">Saring endapan lalu masukkan larutan dalam mesin penyuling.</li>\r\n				<li style=\"text-align:justify\">Hasilnya bioetanol berkadar 99 % atau lebih.</li>\r\n				<li style=\"text-align:justify\">Aduk rata.</li>\r\n				<li style=\"text-align:justify\">Diamkan selama 24 jam.</li>\r\n				<li style=\"text-align:justify\">Campurkan 7 liter bioetanol 90 % dengan 2 &ndash; 3 kg batu gamping.</li>\r\n			</ol><p>&nbsp;</p>\r\n\r\n			<p>Jika diurutkan,&nbsp; petunjuk penggunaan gamping sebagai pemurni bioetanol yang benar adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('740', '13', '\r\n			<p>Perhatikan kalimat &nbsp;berikut!</p>\r\n\r\n			<p>Meskipun tidak bisa hadir dalam pertemuan itu, namun ia tidak begitu kecewa.</p>\r\n\r\n			<p>Agar efektif, kalimat di atas diubah dengan cara&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('741', '13', '\r\n			<p>Perhatikan pernyataan-pernyataan berikut.</p>\r\n\r\n			<p>Ada kekuatan di dalam cinta.</p>\r\n\r\n			<p>Orang yang sanggup memberikan cinta adalah orang yang kuat.</p>\r\n\r\n			<p>Ia bisa mengalahkan keinginannya untuk mementingkan diri sendiri.</p>\r\n\r\n			<p>Dengan cinta, manusia bisa menghasilkan hal-hal yang sangat menakjubkan di dunia ini.</p>\r\n\r\n			<p>Taj Mahal di India dibangun pada abad ke-17 oleh Shah Jehan untuk istri tercintanya, Muntaz Mahal.</p>\r\n\r\n			<p>Kalimat yang berisi fakta pada penggalan teks tersebut ditandai dengan nomor...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('742', '13', '\r\n			<p>Tawanya pecah tatkala menyaksikan aku tersenyum. &ldquo;Tumben, kau tersenyum&rdquo;, katanya. Aku biarkan dia berbicara semuanya kepadaku. Karena aku tahu, dia yang selama ini menahan beban hidup,&nbsp; hari ini,&nbsp; menumpahkannya kepadaku. Di luar, kulihat matahari bersinar dengan penuh pesona.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Latar suasana penggalan cerpen tersebut adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('743', '13', '\r\n			<p>Bacalah paragraf rumpang berikut ini dengan saksama!</p>\r\n\r\n			<p>Menonton film sudah menjadi kegiatan yang wajib diagendakan dalam mengisi waktu liburan. Motivasi untuk menonton film itu bisa karena ingin melihat bintang film pujaannya karena solider terhadap temannya yang mengajak. ... &nbsp;Mereka jelas hanya mengisi waktu luang saja. Nah, kalau itu yang terjadi maka kondisi perfilman Indonesia semakin mengkhawatirkan. Para sineas tentu akan berlomba-lomba membuat film dengan orientasi pasar dan minat konsumen, bukan orientasi mutu.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Kalimat penjelas yang tepat untuk melengkapi paragraf rumpang di atas adalah...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('744', '13', '\r\n			<p>Bacalah contoh iklan berikut dengan saksama!</p>\r\n\r\n			<p style=\"text-align:justify\">Perusahaan distributor mencari akunting, wanita, minimal D-3, IPK 2,75, &nbsp;pengalaman minimal 1 tahun. Lamaran ditujukan ke PO Box 475 Jkt.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">(<em>Kabar Baik</em>, 30 Desember 2019)</p>\r\n\r\n			<p style=\"text-align:justify\">Kalimat pembuka surat lamaran pekerjaan sesuai dengan iklan tersebut adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('745', '13', '\r\n			<p>Contoh kalimat pembuka surat balasan lamaran pekerjaan yang berisi penolakan adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('746', '13', '\r\n			<p><em>Cermati penggalan lirik lagu berikut!</em></p>\r\n\r\n			<p>Mungkin Tuhan mulai bosan melihat tingkah kita</p>\r\n\r\n			<p>Yang selalu salah dan bangga dengan&nbsp; dosa-dosa</p>\r\n\r\n			<p>Atau alam mulai enggan bersahabat dengan kita</p>\r\n\r\n			<p>Coba kita bertanya pada rumput yang bergoyang.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Majas yang dominan pada penggalan lirik lagu di atas adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('747', '13', '\r\n			<p>Perhatikan ilustrasi berikut dengan saksama!</p>\r\n\r\n			<p>Sepeninggal ayahnya, kehidupan Ramon menjadi sulit. Ia lalu hijrah ke Jakarta. Satu-satunya orang yang dikenal adalah pamannya. Ramon tahu kehidupan pamannya lebih sulit dibanding kehidupannya. Namun, apa boleh buat Ramon terpaksa meminta bantuan pamannya yang jelas-jelas tidak dapat memberikan bantuan.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Peribahasa yang sesuai dengan ilustrasi tersebut adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('748', '13', '\r\n			<p>Bacalah penggalan penggalan novel berikut ini!</p>\r\n\r\n			<p>Pria-pria muda yang lebih dulu naik ke dipan-dipan barak asyik main <em>gaple,</em> menghirup mie instan dari gelas plastik, dan main gitar. Jakarta telah merabunkan nurani orang-orang kampung itu yang tahun lalu ketika baru tiba dari udik masih sangat lugu. Cukup setahun, cukup setahun saja, Jakarta bisa saja membuat orang jadi durjana. Mereka tak mengacuhkan ibu-ibu dan anak-anaknya yang menghirup bau pesing WC sampai seluruh isi perut mau melompat. (<em>Maryamah Karpov</em> karya Andrea Hirata)</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Nilai-nilai yang terdapat dalam penggalan novel tersebut adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('749', '13', '\r\n			<p>Cermati penggalan novel berikut!</p>\r\n\r\n			<p>Kereta semakin laju menembus malam. Namun, dramatisasi di kepalanya tidak begitu saja lenyap. Kini ia benar-benar tidak bisa memejamkan matanya. Lamunannya berpindah dari bayangan masa lalu. Sebab goyangan dan bunyi kereta yang khas mengingatkan pada kereta Bangunkarta yang biasa ia naiki dari Jombang ke Jakarta atau sebaliknya dari Jakarta ke Jombang. Kereta itulah yang biasa ia gunakan untuk pulang-pergi, saat ia dulu masih <em>nyantri </em>di Jombang.</p>\r\n\r\n			<p><em>(Balada Cinta Majenun</em>, karya Geidurrahman El Mishry)</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Tahap alur penggalan novel tersebut adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('750', '13', '\r\n			<p>Bacalah petunjuk kerja berikut dengan cermat!</p>\r\n\r\n			<ol><li>Petunjuk mencetak daftar E-mail</li>\r\n				<li>Jalankan Microsoft Outlook 2010</li>\r\n				<li>Klik tab &ldquo;<em>file</em>&rdquo; di pojok kiri atas layar</li>\r\n				<li>Pilih menu &ldquo;<em>Print</em>&rdquo; untuk mencetak</li>\r\n				<li>Di bagian &ldquo;<em>Print What</em>&rdquo;, pilih &ldquo;<em>Table Style</em>&rdquo;</li>\r\n				<li>Di bagian kanan jendela akan muncul <em>preview</em> hasil cetakan yang berisi daftar E-mail</li>\r\n				<li>Di bagian printer, pilih printer yang akan digunakan untuk mencetak</li>\r\n				<li>Klik tombol &ldquo;<em>Print</em>&rdquo; yang ada di bagian atas untuk mencetak</li>\r\n			</ol><p>&nbsp;</p>\r\n\r\n			<p>Pernyataan berikut yang <em>tidak sesuai</em> dengan petunjuk kerja di atas adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('751', '13', '<p>Perbaikilah kalimat berikut agar menjadi benar!</p>\r\n\r\n<p>Kita semua berolah raga setiap hari sabtu pagi di lapangan dekat kantor kelurahan.</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('752', '13', '<p>Temukan ide pokok paragraf berikut!</p>\r\n\r\n<p>Baik siang maupun malam, tempat itu tak pernah sepi. Para pedagang dari penjuru wilayah Jakarta dan sekitarnya selalu memadati tempat tersebut. Pukul 02.00 dini hari, mereka sudah antre membeli buah-buahan dan sayur-sayuran untuk dijual di tempat yang lain. Kendaraan pun menderu-deru berlalu lalang mencari tempat parkir, menambah suasana sepi menjadi ramai. Itulah keadaan pasar Induk Kramat Jati untuk setiap harinya.</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('753', '13', '<p>Buatlah contoh teks <strong>anekdot</strong>!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
