INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('799', '11', 'Kata talenta  dalam Mat 25: 14-30 berasal dari bahasa Yunani &quot;talanton&quot; yang merupakan mata uang Yunani yang Paling kuat. Satuan ukurannya berbeda-beda tergantung waktu, tempat dab jenis logamnya, ada yang 26 kg, 34 kg, dan 41 Kg. Satu talenta isa senilai 6000 dinar. Dalam injil Matius ini Yesus menggunakan perumpamaan tentang talenta yang dapat diartikan sebagai.....', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
