INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('836', '11', '<p>Gadium et Spes artikel 16: (Martabat hati nurani) Di lubuk hatinya manusia menemukan hukum, yang tidak di terimanya dari dirinya sendiri, melainkan harus ditaatinya. Suara hati itu selalu menyerukan kepadanya untuk mencintai dan melaksanakan apa yang baik, dan untuk menghindari apa yang jahat. Bilamana perlu, suara itu menggema dalam lubuk hatinya: jalankanlah ini, elakkanlah itu. Sebab dalam hatinya manusia menemukan hukum yang ditulis oleh Allah. Martabatnya ialah mematuhi hukum itu, dan menurut hukum itu pula ia akan diadili. Hati nurani ialah inti manusia yang paling rahasia, sanggar sucinya; di situ ia seorang diri bersama Allah yang sapaan-Nya menggema dalam batinnya. Berkat hati nurani dikenallah secara ajaib hukum, yang dilaksanakan dalam cinta kasih terhadap Allah dan terhadap sesama. Atas kesetiaan terhadap hati nurani Umat Kristiani bergabung dengan sesama lainnya untuk mencari kebenaran, dan untuk dalam kebenaran itu memecahkan sekian banyak persoalan moral, yang timbul baik dalam hidup perorangan maupun dalam hidup kemasyarakatan. Oleh karena itu semakin besar pengaruh hati nurani yang cermat, semakin jauh pula pribadi-pribadi maupun kelompok-kelompok menghindar dari kemauan yang membabibuta, dan semakin mereka berusaha untuk mematuhi norma-norma kesusilaan yang objektif. Akan tetapi tidak jaranglah terjadi bahwa hati nurani tersesat karena ketidaktahuan yang tak teratasi, tanpa kehilangan martabatnya. Tetapi itu tidak dapat dikatakan tentang orang, yang tidak peduli untuk mencari apa yang benar serta baik, dan karena kebiasaan berdosa hati nuraninya lambat laun hampir menjadi buta. Berdasar artikel diatas, jelaskan upaya manusia untuk membina suara hatinya !</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
