INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('841', '36', '\r\n			<p style=\"text-align:justify\">Yonatan menghargai hak asasi Daud meskipun Daud hanya seorang anak penggembala domba, sebab sikap Yonatan kepada Daud....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('842', '36', '\r\n			<p style=\"text-align:justify\">Tujuan Allah memerintahkan Musa untuk mendirikan kota-kota perlindungan adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('843', '36', '\r\n			<p style=\"text-align:justify\">Kesetiaan dapat kita lihat dalam kesediaan seseorang membela atau menolong orang lain, mengasihinya dan kesediannya untuk tidak meninggalkan&nbsp; pihak yang lain. Dibawah ini adalah contoh kesetiaan adalah...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('844', '36', '\r\n			<p>Daniel adalah seorang yang takut akan Tuhan. Hidupnya hanya taat kepada Allah dan tidak mau menyembah dan makan hasil persembahan berhala. Hari-harinya Daniel makan sayur-sayuran dan tidak mau makan daging apalagi hasil penyembahan berhala. Ia tidak mau mencemarkan hidupnya dengan hasil persembahan berhala. Ia pun diancam akan dimasukkan goa singa. Kisah tersebut yang dapat kita terapkan dalam pergaulan masa kini adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('845', '36', '\r\n			<p>Makna Demokrasi sebagai anugerah Allah adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('846', '36', '\r\n			<p>Dengan menghayati kehidupan demokrasi, orang kristen dapat mewujudkan....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('847', '36', '\r\n			<p style=\"text-align:justify\">Ketuhanan Yang Maha Esa merupakan bentuk integrasi Ketuhanan bagi semua pemeluk agama termasuk agama Kristen. Oleh sebab itu pedoman demokrasi yang mendukung kemajemukan adalah yang berdasarkan&hellip;</p>\r\n\r\n			<p>1. Kebebasan dan terbuka</p>\r\n\r\n			<p>2. Demokrasi Pancasila</p>\r\n\r\n			<p>3. Nilai-nilai demokrasi</p>\r\n\r\n			<p>4. Keberpihakan pada pemerintah</p>\r\n\r\n			<p>5. Hati Nurani yang berwawasan moralitas</p>\r\n\r\n			<p>Pernyataan di atas yang menunjukkan sikap demokrasi yang menghargai nilai kemajemukan adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('848', '36', '\r\n			<p style=\"text-align:justify\">Demokrasi adalah sistem pemerintahan yang berasal dari, oleh, dan untuk rakyat, dimana adanya keterbukaan dan kebebasan berpendapat serta menghargai hak dan kewajiban.</p>\r\n\r\n			<p style=\"text-align:justify\">Penerapan sistem demokrasi dalam keluarga Kristen yang sesuai dengan pernyataan diatas adalah&hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('849', '36', '\r\n			<p>Hal yang paling mendasar dalam demokrasi yaitu kebebasan dan kesetaraan. Kebebasan berkaitan dengan hak asasi manusia sedangkan kesetaraan berhubungan dengan kedudukan setiap orang setara atau sama. Demokrasi merupakan anugerah Tuhan kepada semua manusia yang memberi makna bagi kelangsungan hidup manusia, makna tersebut adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('850', '36', '\r\n			<p style=\"text-align:justify\">Salah satu ciri pemerintahan yang demokratis dan sesuai dengan iman Kristen adalah&hellip;</p>\r\n\r\n			<p>1. Menjunjung tinggi keadilan dan kasih serta takut akan Tuhan</p>\r\n\r\n			<p>2. Mengedepankan keinginan rakyat dari pada kepentingan pribadi</p>\r\n\r\n			<p>3. Berpihak kepada yang lemah dan golongan tertentu</p>\r\n\r\n			<p>4. Memiliki cara pandang yang positif</p>\r\n\r\n			<p>5. Adil dan bijaksana</p>\r\n\r\n			<p>Pernyataan dia atas yang menunjukkan ciri pemerintahan yang sesuai dengan iman Kristen adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('851', '36', '\r\n			<p style=\"text-align:justify\">Salah satu contoh pelaksanaan demokrasi dan kemajemukan di gereja adalah&hellip;</p>\r\n\r\n			<p>1. Sikap menghargai antar denominasi gereja</p>\r\n\r\n			<p>2.Pelayanan diakonia yang tidak membedakan - bedakan</p>\r\n\r\n			<p>3.Adanya pernikahan kudus yang berbeda suku dan adat</p>\r\n\r\n			<p>4.Penunjukan Pendeta oleh sinode</p>\r\n\r\n			<p>5.Kunjungan ke rumah sakit</p>\r\n\r\n			<p>Pernyataan di atas yang termasuk bentuk pelayanan gereja yang memiliki unsur demokrastis dan kemajemukan adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('852', '36', '\r\n			<p style=\"text-align:justify\">Tindakan yang seharusnya dilakukan oleh remaja Kristen dalam menegakkan demokrasi di Indonesia adalah......</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('853', '11', '<p>Jelaskan makna kerja menurut iman Katolik dan berilah contohnya !</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('854', '36', '\r\n			<p style=\"text-align:justify\">Pelanggaran HAM Firaun yang hendak mengurangi jumlah penduduk Ibrani dengan cara....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('855', '36', '\r\n			<p style=\"text-align:justify\">Penyelamatan Allah atas Musa menunjukkan....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('856', '36', '\r\n			<p>Hak asasi manusia yang terdapat dalam alinea pertama pembukaan UUD 1945 adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('857', '36', '\r\n			<p style=\"text-align:justify\">melindungi segenap bangsa Indonesia. Arti Multikulturalisme ialah...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('858', '36', '\r\n			<p style=\"text-align:justify\">Multikultural tidak harus menjadi potensi konflik, jika multikultural dipandang sebagai...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('859', '36', '\r\n			<p>Manusia yang hidup dalam keegoisan dan tidak menerima keberadaan orang lain akan memandang multikultural sebagai potensi terjadinya....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('860', '36', '\r\n			<p>Keberagaman budaya, suku, agama dan cara pandang yang tepat menjadikan setiap perbedaan sebagai kekayaan yang bermanfaat bagi kehidupan bersama, dan perbedaan itu menjadi pemersatu bangsa seperti semboyan bangsa Indonesia yang berbunyi....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('861', '36', '\r\n			<p>Fanatisme atau fanatik adalah suatu keyakinan yang kuat terhadap...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('862', '36', '\r\n			<p>Dalam pergaulan sehari &ndash; hari, seringkali remaja Kristen berselisih paham hanya karena hal &ndash; hal sepele. Hal ini disebabkan &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('863', '36', '\r\n			<p style=\"text-align:justify\">Konsep multikulturalisme tidak sama dengan konsep keanekaragaman dari segi suku bangsa atau kebudayaan. Alasannya ialah karena multikulturalisme menekankan...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('864', '36', '\r\n			<p>Alkitab tidak pernah meniadakan multikultural sebab hal ini merupakan pemberian Allah yang memperkaya kehidupan manusia, hal itu terbukti perjumpaan latar belakang dan suku yang berbeda antara Tuhan Yesus dengan....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('865', '36', '\r\n			<p>Berikut ini, yang termasuk perbuatan menyampaikan &ldquo;kabar baik bagi orang miskin, dan pembebasan bagi orang tertindas&rdquo; adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('866', '36', '\r\n			<p>Tuhan mengizinkan umat manusia hidup dalam kemajemukan dan multikultularisme. Contohnya adalah....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('867', '36', '\r\n			<p>Hidup bersama sebagai dasar kerukunan antar sesama dan sekaligus sebagai wujud kebersamaan dalam perbedaan. Perbedaan bukanlah halangan dalam pergaulan tetapi sebagai langkah untuk&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('868', '36', '\r\n			<p>Menjadi pengikut Kristus menuntut keberanian untuk tampil membela kebenaran dan keadilan. Artinya ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('869', '36', '\r\n			<p>Keadilan tak ada, hilang entah kemana. Padahal mereka adalah Umat Tuhan. Akibatnya ialah&hellip;&hellip;&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
