INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('871', '36', '\r\n			<p>Seorang pelajar Kristen sebagai pembawa damai harus memiliki perilaku selalu berdamai dengan semua orang dan diri sendiri, yang termasuk berdamai dengan diri sendiri adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('872', '36', '\r\n			<p>Dalam tahun politik seperti sekarang ini, banyak konflik yang timbul akibat perbedaan pilihan dan faham. Tidak jarang konflik tersebut juga sampai pada kalangan pemilih pemula. Sebagai peserta didik Kristen yang wajib menjadi pembawa damai sejahtera, memiliki peran yang penting untuk meredam situasi yang ada disekitarnya dengan cara...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
