INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('875', '11', '<p>Jelaskan sifat perkawinan dalam Gereja katolik!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('876', '36', '<p>Pelaksanaan HAM dalam iman Kristen didasari dengan Hukum Kasih, Sebutkan isi dari Hukum Kasih!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('877', '36', '<p style=\"text-align:justify\"><u>Setiap manusia diciptakan serupa dan segambar dengan Allah</u></p>\r\n\r\n<p style=\"text-align:justify\">Dalam Kejadian 1:26-27 dituliskan:</p>\r\n\r\n<p style=\"text-align:justify\"><em>Berfirmanlah Allah: &quot;Baiklah Kita menjadikan manusia menurut gambar dan rupa Kita, supaya mereka berkuasa atas ikan-ikan di laut dan burung-burung di udara dan atas ternak dan atas seluruh bumi dan atas segala binatang melata yang merayap di bumi.&quot;</em></p>\r\n\r\n<p style=\"text-align:justify\"><em>Maka Allah menciptakan manusia itu menurut gambar-Nya, menurut gambar Allah diciptakan-Nya dia; laki-laki dan perempuan diciptakan-Nya mereka.&quot;</em></p>\r\n\r\n<p style=\"text-align:justify\">Berdasarkan kata Alkitab di atas, setiap orang apapun suku, bahasa, warna kulitnya, agamanya, dan status sosialnya diciptakan menurut gambar dan rupa Allah.&nbsp;Tidak ada yang lebih mulia posisinya, dan tidak ada yang lebih rendah nilainya di hadapan Tuhan.</p>\r\n\r\n<p style=\"text-align:justify\">Sebutkan tokoh &ndash;tokoh perjuangan anti Diskriminasi di Indonesia&nbsp; kemudian jelaskan dengan&nbsp; singkat mengenai teladan perjuangannya melawan Diskriminasi di Indonesia!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('878', '36', '<p style=\"text-align:justify\"><u>Galatia 5:</u><u>19-21</u><u> TB</u></p>\r\n\r\n<p style=\"text-align:justify\"><em>&ldquo;</em><em>Perbuatan daging telah nyata, yaitu: percabulan, kecemaran, hawa nafsu, penyembahan berhala, sihir, perseteruan, perselisihan, iri hati, amarah, kepentingan diri sendiri, percideraan, roh pemecah, kedengkian, kemabukan, pesta pora dan sebagainya. Terhadap semuanya itu kuperingatkan kamu &ndash; seperti yang telah kubuat dahulu &ndash; bahwa barangsiapa melakukan hal-hal yang demikian, ia tidak akan mendapat bagian dalam Kerajaan Allah.</em><em>&rdquo;</em></p>\r\n\r\n<p>Untuk menjadi pembawa damai sudah seharusnya kita menghindari perbuatan daging dengan mengikuti keinginan Roh yang terdapat pada 9 buah Roh, Sebutkan 5 dari buah Roh!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('879', '36', '<p style=\"text-align:justify\"><u>Matius 5:9 TB</u></p>\r\n\r\n<p style=\"text-align:justify\"><em>&ldquo;</em><em>Berbahagialah orang yang membawa damai, karena mereka akan disebut anak-anak Allah.</em><em>&rdquo;</em></p>\r\n\r\n<p>Berdasarkan ayat tersebut di atas tuliskan 2 (dua) contoh perilaku pembawa damai dalam kehidupan sehari-hari!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('880', '36', '<p style=\"text-align:justify\"><u>Matius 5: 13-16</u></p>\r\n\r\n<p style=\"text-align:justify\"><em>&ldquo;Kamu adalah garam dunia. Jika garam itu menjadi tawar, dengan apakah ia diasinkan? Tidak ada lagi gunanya selain dibuang dan diinjak orang. Kamu adalah terang dunia. Kota yang terletak di atas gunung tidak mungkin tersembunyi. Lagipula orang tidak menyalakan pelita lalu meletakkannya di bawah gantang, melainkan di atas kaki dian sehingga menerangi semua orang di dalam rumah itu. Demikianlah hendaknya terangmu bercahaya di depan orang, supaya mereka melihat perbuatanmu yang baik dan memuliakan&nbsp; Bapamu yang di sorga.&rdquo; (TB)</em></p>\r\n\r\n<p>Berdasarkan ayat di atas, jelaskan maksud dari garam dan terang dunia!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
