INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('926', '22', '\r\n			<p>Di bawah ini yang merupakan besaran turunan adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('927', '22', '\r\n			<p>Berikut langkah menggunakan mikrometer sekrup:</p>\r\n\r\n			<ol><li>Jumlahkan skala nonius dengan skala utama.</li>\r\n				<li>Letakkanlah benda yang ingin diukur di antara rahangnya.</li>\r\n				<li>Putarlah gigi geser secara perlahan pada selubung pemutar hingga terdengar suara &ldquo;klik&rdquo;.</li>\r\n				<li>Baca atau lihatlah skala utama.</li>\r\n				<li>Kunci kembali mikrometer sekrup.</li>\r\n				<li>Baca skala nonius yang tepat segaris dengan skala utama.</li>\r\n				<li>Membuka pengunci mikrometer sekrup sehingga selubung dapat bergerak.</li>\r\n			</ol><p>Urutan langkah yang benar adalah&hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('928', '22', '\r\n			<p>Berdasarkan penelitian terhadap mamalia diperoleh data bahwa setiap denyut jantungnya, kira-kira 20 gram darah dipercepat dari 0,25 m/s menjadi 0,35 m/s dalam waktu 0,10 detik. Besar gaya yang diberikan oleh otot jantung adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('929', '22', '\r\n			<p>Perhatikan hasil pengukuran tebal logam menggunkaan mikrometer sekrup berikut.</p>\r\n\r\n			<p><img id=\"Picture_x0020_1\" src=\"file:///C:/Windows/TEMP/msohtmlclip1/01/clip_image001.png\" style=\"height:96.75pt; width:200.25pt\"></p>\r\n\r\n			<p>Tebal logam tersebut adalah&hellip; mm</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('930', '22', '\r\n			<p>Mobil bermassa 800 kg bergerak dengan kecepatan 5&nbsp;m/s2m/s2&nbsp;pada lintasan melingkar dengan jari-jari 25 meter. Gaya sentripetal yang bekerja pada mobil adalah&hellip; .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('931', '22', '\r\n			<p>Sebuah balok ditarik dengan tali yang membentuk sudut 60<sup>o</sup> terhadap lantai. Jika gaya tarik pada tali 30 N dan balok berpindah sejauh 5m, maka usaha yang dilakukan adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('932', '22', '\r\n			<p>Suhu suatu zat adalah 25 derajat C. Jika diukur oleh termometer skala fahrenheit, maka suhu zat tersebut adalah ...<sup>o</sup>F</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('933', '22', '\r\n			<p style=\"text-align:justify\">Sebuah batang besi yang panjangnya 2 m, penampangnya berukuran 4 mm x 2 mm. Modulus elastisitas besi tersebut adalah&nbsp;10<sup>5</sup>&nbsp;N/mm<sup>2</sup>. Jika pada ujung batang ditarik dengan gaya 40 N. Besar pertambahan panjang besi tersebut adalah&hellip;..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('934', '22', '\r\n			<p>Perhatikan gambar susunan beberapa hambatan listrik berikut ini!&nbsp;</p>\r\n\r\n			<p><img id=\"Picture_x0020_3\" src=\"file:///C:/Windows/TEMP/msohtmlclip1/01/clip_image002.png\" style=\"height:58.5pt; width:202.5pt\"></p>\r\n\r\n			<p>Besar hambatan pengganti (hambatan total) antara titik A dan B dari gambar rangkaian di atas adalah ....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('935', '22', '\r\n			<p style=\"text-align:justify\">Arus listrik sebesar 10 A mengalir pada sebuah penghantar selama 2 menit. Banyaknya muatan listrik yang mengalir pada penghantar adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('936', '22', '\r\n			<p style=\"text-align:justify\">Sebuah lampu digunakan selama 1 jam,jika pada lampu bertuliskan&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">220 V &ndash; 5 A maka besar&nbsp; energy listrik yang diperlukan lampu tersebut adalah&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('937', '22', '\r\n			<p style=\"text-align:justify\">Dua alat pemanas listrik,apabila digunakan secara sendiri-sendiri akan membutuhkan waktu masing-masing 15 dan 10 menit untuk mendidihkan air satu panci.Apabila keduanya dihubungkan secara seri,dengan sumber GGL yang tetap sama seperti semula,maka air satu panci akan mendidih dalam waktu(dalam menit)&hellip;..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('938', '22', '\r\n			<p>Bagian dari sel yang bersifat permeable adalah...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
