INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1015', '16', '\r\n			<p style=\"text-align:center\"><strong>JATIM PARK</strong></p>\r\n\r\n			<p>For people in East Java, Jatim Park may have been heard many times as it is one of the famous tourism objects in East Java province. Jatim Park offers a recreation place as well as a study center.</p>\r\n\r\n			<p>Jatim Park is located on Jl. Kartika 2 Batu, East Java. To reach the location is not too difficult because the object is only 2,5 kilos meters from Batu city. This Jatim Park tourism object is about 22 hectares width.</p>\r\n\r\n			<p>Visitor can enjoy at least 36 kinds of facilities which can attract them as well as give new knowledge. Just after the pass gate, the visitors will find an interesting view of &lsquo;Galeri Nusantara&rsquo; area. This study offering continues to step on &lsquo;Taman Sejarah&rsquo; area, which contains of miniature temple in East Java like Sumberawan temple, customhouse of Kiai Hasan Besari Ponorogo and Sumberawan Statue.</p>\r\n\r\n			<p>The other facility which is able to be enjoyed is &lsquo;Agro Park&rsquo; area. It presents crop and rareness fruits, animal diorama which consists of unique animals that have been conserved, and supporting games like bowling, throw ball, scooter disco, etc Jatim Park is suitable for family and school recreation. The recreation area sites offer precious tour and can be used as alternative media of study.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Where is Jatim Park located?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
