INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1020', '16', '\r\n			<p>Last week my friend and I were bored after two weeks of holidays, so we rode our bicycles to a beach, which is only five kilometres from where we live.</p>\r\n\r\n			<p>When we arrived at the beach, we were surprised to see only a few visitors there. After having a quick dip in the ocean, which was really cold, we realised why there were not many people there. it was also quite windy.</p>\r\n\r\n			<p>After we bought several hot chips at the take-away store nearby, we rode our bicycles down the beach for a while, on the hard, damp part of the sand. We had the behind us. Unwittingly, we were many miles down the beach.</p>\r\n\r\n			<p>Before we made the long trip back we decided to paddle our feet in the water for a while, and then sit down for a rest. While we were sitting on the beach, just chatting, we realised that all the way back we would be riding into the strong wind. When we finally arrived home, we were both totally exhausted!</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>The text mainly tells us about&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
