INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1034', '16', '\r\n			<p>Mr. Yonky&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : What&rsquo;s your opinion of the reality show&rsquo;s program on television?</p>\r\n\r\n			<p>Mr. Kishan&nbsp;&nbsp; : Well, they&rsquo;re bad. I don&rsquo;t like watching it.</p>\r\n\r\n			<p>Mr. Yonky&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &hellip;&hellip;&hellip;&hellip; Most of them make us bored.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
