INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1037', '16', '\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;How to Make Starfruit Punch&rdquo;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><u>Ingredients</u></p>\r\n\r\n			<p>250 gr yellow starfruit in slices</p>\r\n\r\n			<p>100 ml water 2 spoonful of vanilla</p>\r\n\r\n			<p>8 teaspoonful of lemonade extract Procedure</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><u>Steps</u></p>\r\n\r\n			<p>Put slices of starfruit and water in the blender. Wait until it&rsquo;s soft. Skim it.</p>\r\n\r\n			<p>Add syrup, lemonade extract, and soda water. Stir thoroughly.</p>\r\n\r\n			<p>Pour it in the glass and put in the ice cubes.</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>What is the text about?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
