INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1043', '16', '\r\n			<p>John&nbsp; : I can&rsquo;t wait to see James at the final competition tonight.</p>\r\n\r\n			<p>Mark : Why?</p>\r\n\r\n			<p>John&nbsp; : If he wins, he &hellip;&hellip;. us next week.</p>\r\n\r\n			<p>Mark : Really?</p>\r\n\r\n			<p>John&nbsp; : Yes. Will you come tonight?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1044', '16', '\r\n			<p>Ani&nbsp;&nbsp; : Look! Mia spends her holiday in New Zealand!</p>\r\n\r\n			<p>Sarah : Wow, she&rsquo;s so lucky. She has a lot of money.</p>\r\n\r\n			<p>Ani&nbsp;&nbsp; : If I &hellip;&hellip;. her, I would buy a car and build a big house for my parents.</p>\r\n\r\n			<p>Sarah : Nice. I would do the same.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1045', '16', '\r\n			<p><em>Computers are machine that handle information automatically. They can perform calculations and process data. Computers can work with numbers to solve problems in a few seconds. Computers can remember a great deal of information. That is why computers are widely used in places, such as banks, offices, dan companies.</em></p>\r\n\r\n			<p><em>Computers work like calculators. But most calculators can do only one thing at a time. We tell them to do by pressing various buttons. To do the same work, we can give a series of instructions to a computer. We call this a computer program. If we set up a program, the computer can provide a program, the computer can do all this work automatically without further help or instruction.</em></p>\r\n\r\n			<p><em>A computer stores and handles numbers. The numbers may be mathematical formulas or columns of figures. The numbers may also be codes that stand for letters of the alphabet, words, or instructions to the computer.</em></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><em>Why are computers widely used in many places? Because &hellip;&hellip;.</em></p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
