INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1049', '16', '\r\n			<p>Jim&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : There&rsquo;s so many things to do but so little time!</p>\r\n\r\n			<p>Lily&nbsp;&nbsp; : Yeah, but if we don&rsquo;t finish this homework by tomorrow, we&rsquo;re going to get punished&nbsp;</p>\r\n\r\n			<p>Jim&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : You&rsquo;re right, &hellip;.&nbsp;</p>\r\n\r\n			<p>Lily&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Yeah, I agree, so let&rsquo;s stop talking and get to work.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1050', '16', '\r\n			<p>Jane&nbsp; : Mom and dad have you seen my earpods around here?</p>\r\n\r\n			<p>Mom : No, do you remember where you put them last time?</p>\r\n\r\n			<p>Jane&nbsp; : I can&rsquo;t seem to remember, but I remember using it in my bedroom yesterday.</p>\r\n\r\n			<p>Dad&nbsp; : &hellip;&hellip;&hellip;. I saw it somewhere in bedroom yesterday.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1051', '16', '<p>Jakarta, July 22nd&nbsp;2022</p>\r\n\r\n<p>Mr. Danu Wijaya<br />\r\nHead of Human Resource Department<br />\r\nPT. Bintang Abadi<br />\r\nJalan Mangga No. 89B<br />\r\nJakarta</p>\r\n\r\n<p>Dear Mr. Danu Wijaya<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Based on the job vacancy in Tempo Magazine at July 20th2022, I would like to apply in your company as an Accountant.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;I consider myself to be qualified for the job. I have years of experience in accounting and that might be an asset to your company, PT. Bintang Abadi, in aiming and reaching the company&rsquo;s goals in the future.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;I got my bachelor degree in accounting 5 years ago and after that I completed a professional certification on tax. I have experience in accounting division in some companies for 3 years and&nbsp;I am usually responsible for the preparation of monthly consolidate financial statements in the companies. I have experience in taking care of the management of the company and making public reporting for 2 years.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Herewith the letter, I enclose my copy of Bachelor Degree Certificate, my academic transcript, my curriculum vitae, and my recent photograph with size of 4&times;6.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;I have high to be qualified for the job and that I can be the part of your company in the near future.</p>\r\n\r\n<p>Sincerely</p>\r\n\r\n<p>Citra Kirana</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>How did the job seeker know job vacancy?</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
