INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1101', '26', '\r\n			<p>Cermati artikel berikut</p>\r\n\r\n			<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:center\"><strong>Waktu Dekomposisi Limbah Popok Bayi Sekali Pakai</strong></p>\r\n\r\n			<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n			<p>Setiap material sampah baik <strong>sampah organik</strong> maupun <strong>sampah anorganik</strong> pasti akan mengalami penguraian (dekomposisi) secara alami, namun waktu yang dibutuhkan kedua jenis sampah tersebut sangat berbeda jauh. Berikut adalah waktu dekomposisi dari beberapa jenis material sampah organik dan anorganik.</p>\r\n\r\n			<p><img id=\"Picture_x0020_2\" src=\"[base_url]uploads/mapel_26/6419703755787.png\" style=\"height:234.75pt; width:440.25pt\"></p>\r\n\r\n			<p>Dari data pada Gambar 1, dapat disimpulkan bahwa sampah anorganik membutuhkan waktu yang lebih lama untuk terurai di banding sampah organik. <strong>Popok Bayi sekali pakai</strong> (Pampers, Sweety, dll) membutuhkan waktu <strong>terurai lebih lama daripada plastik</strong>, namum <strong>lebih cepat dibanding kulit sintetis</strong>. Jadi, waktu yang mungkin dibutuhkan popok bayi sekali pakai untuk terurai di alam adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1102', '26', '\r\n			<p>Perhatikan gambar ilustrasi susunan partikel zat dalam tiga wujud berikut:</p>\r\n\r\n			<p><img id=\"Picture_x0020_8\" src=\"[base_url]uploads/mapel_26/641970377e908.png\" style=\"height:131.25pt; width:248.25pt\"></p>\r\n\r\n			<p>dari gambar tersebut yang merupakan <strong>karakteristik dari zat padat</strong> adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1103', '26', '\r\n			<p>Perhatikan Gambar berikut!</p>\r\n\r\n			<p><img id=\"Picture_x0020_9\" src=\"[base_url]uploads/mapel_26/64197037af71c.png\" style=\"height:138pt; width:198pt\"></p>\r\n\r\n			<p>Berdasarkan gambar tersebut, proses <strong>menyublim</strong> ditunjukkan oleh nomor&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1104', '26', '\r\n			<p>Perhatikan zat-zat berikut:</p>\r\n\r\n			<ol><li>lelehan garam dapur</li>\r\n				<li>air (H<sub>2</sub>O)</li>\r\n				<li>natrium (Na)</li>\r\n				<li>gas karbon dioksida (CO<sub>2</sub>)</li>\r\n				<li>tembaga (Cu)</li>\r\n				<li>oksigen (O)</li>\r\n				<li>larutan garam dapur</li>\r\n			</ol><p>materi yang tergolong <strong>senyawa</strong> adalah</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1105', '26', '\r\n			<p>Perhatikan gambar teknik pemisahan campuran berikut.</p>\r\n\r\n			<p><img id=\"Picture_x0020_10\" src=\"[base_url]uploads/mapel_26/6419703804a5a.png\" style=\"height:129pt; width:158.25pt\"></p>\r\n\r\n			<p>Gambar di atas merupakan pemisahan campuran dengan teknik&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1106', '26', '\r\n			<p>Perhatikan pernyataan-pernyataan tentang teori atom berikut ini!</p>\r\n\r\n			<ol><li style=\"text-align:justify\">Atom adalah bagian terkecil dari benda yang tidak dapat dibagi-bagi lagi</li>\r\n				<li style=\"text-align:justify\">Atom terdiri dari material yang bermuatan positif dan elektron bermuatan negatif serta elektron tersebar merata di dalam material tersebut</li>\r\n				<li style=\"text-align:justify\">Atom terdiri dari elektron yang bermuatan negatif dan inti atom yang bermuatan positif dengan elektron bergerak berorbit inti atom</li>\r\n				<li style=\"text-align:justify\">Di dalam atom elektron dapat berpindah dari orbit lintasannya tanpa melepas atau memancarkan energi</li>\r\n			</ol><p><strong>Yang membedakan</strong> <strong>model atom menurut Dalton</strong> dan <strong>Rutherford</strong> adalah pernyataan nomor&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1107', '26', '\r\n			<p>Amatilah model atom berikut!</p>\r\n\r\n			<p><img id=\"Picture_x0020_11\" src=\"[base_url]uploads/mapel_26/64197038502d6.png\" style=\"height:131.25pt; width:162.75pt\"></p>\r\n\r\n			<p>Subpartikel dalam atom yang paling mudah lepas/keluar dari atom dan menyebabkan atom menjadi bermuatan adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1108', '26', '\r\n			<p>Sebuah atom terdiri dari 3 proton, 3 elektron dan 2 neutron.&nbsp; Notasi yang benar untuk atom tersebut adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1109', '26', '\r\n			<p>Perhatikan notasi atom berikut:</p>\r\n\r\n			<p><img id=\"Picture_x0020_12\" src=\"[base_url]uploads/mapel_26/641970389daff.png\" style=\"height:120pt; width:2in\"></p>\r\n\r\n			<p>Jumlah proton, elektron dan neutron pada atom tersebut adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1110', '26', '\r\n			<p style=\"text-align:justify\">Perhatikan kedua notasi atom Kalium (K) dan Kalsium (Ca) berikut :</p>\r\n\r\n			<p style=\"text-align:justify\"><img id=\"Picture_x0020_14\" src=\"[base_url]uploads/mapel_26/64197038c6991.png\" style=\"height:111pt; width:294pt\"></p>\r\n\r\n			<p style=\"text-align:justify\">Kedua atom tersebut memiliki kesamaan dalam jumlah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1111', '26', '\r\n			<p style=\"text-align:justify\">Konfigurasi elektron untuk atom kromium yang memiliki notasi atom <strong><sub>19</sub>Kr<sup>39</sup></strong><strong><sup></sup></strong>adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1112', '26', '\r\n			<p>Unsur A memiliki konfigurasi elektron 2, 8, 8, 1. Dalam Tabel Sistem Periodik, unsur tersebut terletak pada&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1113', '26', '\r\n			<p>Diketahui konfiurasi elektron unsur-unsur berikut:</p>\r\n\r\n			<p>H= 1</p>\r\n\r\n			<p>Li= 2.1</p>\r\n\r\n			<p>Na = 2. 8. 1</p>\r\n\r\n			<p>Br= 2.8.18. 7</p>\r\n\r\n			<p>Rb= 2.8.18.8.1</p>\r\n\r\n			<p>Unsur yang memiliki <strong>jari-jari atom terbesar</strong> adalah</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1114', '26', '\r\n			<p style=\"text-align:justify\"><strong>Urea</strong>&nbsp;adalah adalah&nbsp;<strong>senyawa</strong>&nbsp;organik tunggal&nbsp;yang tersusun&nbsp;dari&nbsp;unsur karbon, hidrogen, oksigen dan nitrogen dengan rumus molekul <strong>CO(NH<sub>2</sub>)<sub>2</sub></strong>. Senyawa ini yang banyak digunakan sebagai pupuk pertanian. Jumlah masing-masing atom yang menyusun molekul senyawa CO(NH<sub>2</sub>)<sub>2</sub><sub></sub>adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1115', '26', '\r\n			<p>Diketahui beberapa unsur dengan konfigurasi elektron sebagai berikut : &nbsp;&nbsp;&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">P = 2 8 7 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ;Q = 2 8 8&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">R = 2 8 8 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;;S = 2 8 18 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ;T = 2 8 18 2 &nbsp;&nbsp;&nbsp;</p>\r\n\r\n			<p>Diantara unsur di atas, yang <strong>paling stabil</strong> (paling sukar membentuk ikatan kimia ) adalah</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1116', '26', '\r\n			<p style=\"text-align:justify\">Unsur X dengan kofigurasi elektron : 2 8 7 dapat mencapai aturan oktet dengan cara&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1117', '26', '\r\n			<p>Unsur X dengan konfigurasi elektron: 2 8 1 dapat membentuk <strong>ikatan ion</strong> dengan unsur yang memiliki konfigurasi elektron&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1118', '26', '\r\n			<p>Diketahui nomor atom beberapa unsur sebagai berikut:</p>\r\n\r\n			<p>A= 6</p>\r\n\r\n			<p>B= 11</p>\r\n\r\n			<p>C= 17</p>\r\n\r\n			<p>D= 18</p>\r\n\r\n			<p><strong>Ikatan paling kovalen</strong> dapat terbentuk antara pasangan atom-atom berikut&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1119', '26', '\r\n			<p>Jika unsur <strong><sub>15</sub>P </strong>dan unsur <strong><sub>8</sub>O </strong>berikatan dan membentuk suatu senyawa,, maka jenis ikatan kimia dan rumus molekul senyawa yang terbentuk adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1120', '26', '\r\n			<p>Dalam praktikum, sekelompok siswa membakar secara sempurna 46gram&nbsp;gula glukosa dengan rumus molekul <strong>C<sub>6</sub>H<sub>12</sub>O<sub>6</sub></strong>. <strong>Rumus empiris</strong> dari glukosa adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1121', '26', '\r\n			<p>Diantara reaksi &ndash; reaksi dibawah ini yang <strong><em>tidak </em></strong>mengikuti hukum kekekalan massa adalah . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1122', '26', '\r\n			<p>Pada komposisi suatu tablet suplemen makanan tertulis bahwa setiap tablet <strong>mengandung Magnesium 250 mg</strong> dalam bentuk Magnesium Carbonat dengan rumus kimia MgCO<sub>3</sub>. <strong>Berat Magnesium Carbonat</strong> pada tiap tablet suplemen makanan tersebut adalah ..... (diketahui Ar Mg =24; C = 12; O = 16)</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1123', '26', '\r\n			<p style=\"text-align:justify\">Suatu reaksi kimia dikatakan setara jika atom-atom yang sejenis di ruas kiri dan kanan memiliki jumlah yang sama. Agar persamaan reaksi antara gas fosfor (P<sub>4</sub>) dan gas klorin (Cl<sub>2</sub>) berikut setara,</p>\r\n\r\n			<p><strong><em>a</em></strong><em> </em>P<sub>4(<em>g</em>)</sub> + <strong><em>b</em></strong> Cl<sub>2(<em>aq</em>)</sub>&nbsp; &agrave;&nbsp; &nbsp;<strong><em>c</em></strong> PCl<sub>3(<em>aq</em>)</sub></p>\r\n\r\n			<p>maka harga koefisien reaksi <strong><em>a, b,</em> </strong>dan<strong><em> c </em></strong>&nbsp;berturut-turut adalah &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1124', '26', '\r\n			<p>Senyawa hidrokarbon dengan rumus molekul <strong>C<sub>6</sub>H<sub>14</sub></strong>mempunyai nama &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1125', '26', '\r\n			<p>Nama dari senyawa dengan rumus struktur :</p>\r\n\r\n			<p><img id=\"Picture_x0020_1\" src=\"[base_url]uploads/mapel_26/6419703aeaade.png\" style=\"height:45pt; width:192pt\"></p>\r\n\r\n			<p>adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1126', '26', '\r\n			<p style=\"text-align:justify\">Kualitas bahan bakar bensin dikaitkan dengan jumlah ketukan (<em>knocking</em>) yang ditimbulkannya. Campuran pada bensin yang mempunyai efisiensi paling tinggi adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1127', '26', '\r\n			<p style=\"text-align:justify\">Diberikan lima macam plimer</p>\r\n\r\n			<ol><li>PVC</li>\r\n				<li>poliisoprena</li>\r\n				<li>politena</li>\r\n				<li>selulosa</li>\r\n				<li>polivinil asetat</li>\r\n			</ol><p>yang termasuk <strong>polimer alam</strong> adalah&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1128', '26', '\r\n			<p>Suatu sampel dari air kolam renang yang diuji dengan pH-meter menunjukkan pH sebesar 5,9. Artinya, air kolam renang tersebut bersifat&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1129', '26', '\r\n			<p>Mudah atau tidaknya logam berkarat tergantung pada . . . .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1130', '26', '\r\n			<p style=\"text-align:justify\">Perlindungan korosi yang paling tepat dilakukan untuk melindungi logam pada bagian mesin yang berputar adalah &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1132', '26', '<p>Tentukan jumlah masing-masing atom penyusun senyawa asam sulfat yang terdiri dari atom H, S, dan O dan memiliki rumus kimia H<sub>2</sub>SO<sub>4</sub>!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1133', '26', '<p>Al<sub>2</sub>(SO<sub>4</sub>)<sub>3</sub> merupakan salah satu senyawa kimia anorganik yang digunakan dalam industry pemurnian air minum, pengolahan air limbah dan digunakan di industry pembuatan kertas. Tentukan jenis dan jumlah atom-atom penyusun senyawa kimia Al<sub>2</sub>(SO<sub>4</sub>)<sub>3 </sub>!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1134', '26', '<p>Jelaskan definisi <strong>Asam </strong>dan<strong> Basa </strong>menurut <strong>Arrhenius!</strong></p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1135', '26', '<p>Diketahui notasi atom kalsium (Ca)</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_26/641970ee6b896.png\" /></p>\r\n\r\n<p>Tuliskan</p>\r\n\r\n<p>a. konfigurasi elektronnya!</p>\r\n\r\n<p>b. letak golongan dan periodenya dalam sistem periodik unsur!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1136', '26', '<p>Diketahui notasi atom kalsium (Ca)</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_26/6419712eb2381.png\" /></p>\r\n\r\n<p>Tuliskan:</p>\r\n\r\n<p>a. konfigurasi elektronnya!</p>\r\n\r\n<p>b. letak golongan dan periodenya dalam sistem periodik unsur!</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1137', '19', '\r\n			<p>Ing perang <strong>Bharatayudha</strong>, Karna mb&eacute;lani <strong>Kurawa</strong>. Satriya iki ngerti y&egrave;n sajatin&eacute; Kurawa kang salah. Nanging dh&egrave;w&egrave;k&eacute; ngugemi jejer ing satriya kudu mbela sapa wong sing mbiy&egrave;n mbela dh&egrave;w&egrave;k&eacute;. Ing perang iku, <strong>Karna</strong> bisa mat&eacute;ni <strong>Gathotkaca</strong> nganggo pusaka Kuntowijoyondanu. Dh&egrave;w&egrave;k&eacute; uga m&eacute;h mat&eacute;ni <strong>Arjuna</strong>. Nanging panah&eacute; luput amarga <strong>Prabu Salya</strong> nyendhal jaran&eacute;. Salya nalika iku dadi kusir&eacute; Karna, kang sajatin&eacute; mantun&eacute; dh&eacute;w&eacute;. D&eacute;n&eacute; Arjuna dikusiri d&eacute;ning <strong>Kresna</strong>. Ing k&eacute;n&eacute;, Karna mati kena panah&eacute; Arjuna, kyai Pasopati. Patuladan kang bisa dijupuk saka critane Adipati Karna kasebut yaiku ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1138', '19', '\r\n			<p>Lana&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Mil, Koen apa wis tau <strong>ngicipi</strong> sate nyambik?</p>\r\n\r\n			<p>Mila&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Durung Lan, apa sampeyan wis tau? Lek uwis, <strong>mudhut</strong> e nang endi toh?</p>\r\n\r\n			<p>Lana&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Ning mburine stadion Gajayana, rasane muaknyuuus.</p>\r\n\r\n			<p>Mila &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Tenanan? Karo sapa sampeyan <strong>dhahar</strong> ning kono Lan?</p>\r\n\r\n			<p>Lana&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Karo Pakdheku Mil. Pakdheku <strong>mangan</strong> enthek akeh.</p>\r\n\r\n			<p>Mila&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Ya wis kapan-kapan aku tak <strong>menyang</strong> kono Lan.</p>\r\n\r\n			<p>Unggah-ungguh basa kang kurang trep ing pacelaton ing nduwur yaiku ...&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
