INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1140', '19', '\r\n			<p>Saben dina agus <strong><em>adol kringet</em></strong> ing pasar subuh.</p>\r\n\r\n			<p>Tembung kang kaserat kandhel ing ukara kasebut, duweni teges ...&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1141', '19', '\r\n			<p><em>Gareng-gareng Gathotkaca sru anangis</em></p>\r\n\r\n			<p><em>Sambate mlas arsa</em></p>\r\n\r\n			<p><em>Luhnya marawayan mili</em></p>\r\n\r\n			<p><em>Gung tinameng astarani</em></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Tembang ing dhuwur kalebu jenis tembang macapat &hellip;&nbsp;&nbsp;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1142', '19', '\r\n			<p>Guru gatra, guru lagu, lan guru wilangan tembang macapat kasebut, yaiku &hellip;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1143', '19', '\r\n			<p><strong>Banjir Bandhang </strong></p>\r\n\r\n			<p><em>Dening: Sendhang Mulyana&nbsp; </em></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p><em>Banjir bandhang</em></p>\r\n\r\n			<p><em>Kabeh kang dipantha-pantha </em></p>\r\n\r\n			<p><em>Lan digantha-gantha </em></p>\r\n\r\n			<p><em>Ilang katerjang </em></p>\r\n\r\n			<p><em>Jerit tangis ngiris ati </em></p>\r\n\r\n			<p><em>Apa iku bebendu saka </em></p>\r\n\r\n			<p><em>Gusti Sebab manungsa wis padha ngawur, </em></p>\r\n\r\n			<p><em>Alas ditebas tanpa welas </em></p>\r\n\r\n			<p><em>Gunung-gunung gundhul konal-kanul </em></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Amanat kang kinandhut saka geguritan kasebut yaiku ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1144', '19', '\r\n			<p>Virus Corona kang newasake sawetara 26 wong ing China, lan nyebar ing negara Singapura, Thailand, Amerika Serikat nganti tekan Arab Saudi. Menteri Kesehatan Terawan Agus Putranti ngimbau kanggo masyarakat supaya nerapake pola urip sehat lan jaga daya tahan awak guna minimalisir potensi kena infeksi virus corona.&nbsp;</p>\r\n\r\n			<p>Saka pethikan artikel kasebut intine yaiku?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1145', '19', '\r\n			<p>Panulise angka jawa kudu diapit nganggo?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1146', '19', '\r\n			<p style=\"text-align:justify\"><strong>Bumiku </strong></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Dening: Anonim&nbsp; </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\"><em>Kabentang indahe bumiku </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Tan katon ijo royo-royo </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Para kewan pada manut mring ndarane </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Ana ing sawah anggarap siti </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Nanging, saiki ora kaya mbiyen </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Nanging, saiki bumiku wis rusak </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Kaya-kaya wis ora ana ijo-ijoan meneh </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Karana ulahe manungsa </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Imaji kang ana ing geguritan kasebut minangka ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1147', '19', '\r\n			<p style=\"text-align:justify\"><em>Minangka purwakaning atur, mangga sami ngaturaken puji syukur dhumateng ngarsanipun Allah SWT, awit saking rahmat lan hidayahipun kula lan panjenengan kaparinga wekdal ngrawuhi pengetan dinten Kartini, kanthi kawilujengan, kasarasan, miwah kabahagyan.</em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Rantaman adicara saka teks pewara ing dhuwur yaiku &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1148', '19', '\r\n			<p style=\"text-align:justify\"><em>Para rawuh ingkang&nbsp; minulya, mbok menawi namung menika ingkang saged kula aturaken, menawi kathah kalepataning atur saha solah bawa ingkang kirang nuju prana, kula nyuwun agunging pangaksami.&nbsp; </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Pethikan pidhato ing dhuwur klebu peranganing,....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1149', '19', '\r\n			<p style=\"text-align:justify\"><strong>Pak Dhe :</strong> Dadi tekamu mrene kabeh iki karepe arep nanggap critane Pak Dhe, ngono? Lha jarene&nbsp; sing arep mrene kancamu sak kelas, kok iki mung bocah papat?</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Aku :</strong>&nbsp;&nbsp; Inggih, Pak Dhe. (<em>Aku mangsuli karo rada kecipuhan</em>) Kados ingkang sampun kula aturaken kala emben, kula sakanca kepengin sanget sinau bab ringgit kaliyan Pak Dhe. Bab sagedipun lare sekawan ingkang sowan, Arif ingkang ngertos. Amargi bibar sekolah wau kula kaliyan kanca-kanca pisah, kula wangsul rumiyin nderekaken Ibu menyang Pabrik. Ibu dinten sakmenika mlebet shift sore.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Sajroning pethikan drama ing dhuwur sing dadi setinge wektu yaiku?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1150', '19', '\r\n			<p style=\"text-align:justify\"><strong>Emak</strong> :&nbsp; Ya wis, bocah &ndash; bocah&hellip;kowe aja sok aji mumpung ! Emak seneng ndeleng kowe sregep nyambut gawe,&nbsp; kaya &ndash; kaya sesuk ora bakal mati. Nanging, isih ana kewajiban utama kang isih kudu koktindakake.</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Koor </strong>:&nbsp; Maaakk&hellip;( kabeh ngrungket emake )</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Emak</strong> :&nbsp; Sejatine kowe kuwi anake sapa , ora penting. Sing penting tugasmu ndongakake, muga &ndash; muga wong tuwamu diparingi apura Gusti Allah, sih urip apa dene wis mati..&nbsp;&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Miturut crita ing duwur patrape Emak kang isa ditiru yaiku...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1151', '19', '\r\n			<p style=\"text-align:justify\"><em>Geter raosipun manah // Swara para janma tansah jejerit // Sakabehe wus kagulung // Murka aneng samodra // Tirta lan samirana samya gumulung // Among bisa andedonga // Kamiwelas mring Gusti // </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Tembang macapat ing dhuwur nyritakake babagan prastawa alam&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1152', '19', '\r\n			<p style=\"text-align:justify\"><em>Salah sawijining dina ana wong ngemis tuwa lagi njaluk sedekah menyang mahasiswa</em>.</p>\r\n\r\n			<p style=\"text-align:justify\">Pengemis&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Mas, Bapak nyuwun sedekahe mas&hellip;</p>\r\n\r\n			<p style=\"text-align:justify\">Mahasiswa&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : (karo nyokot HP, dheweke mbukak dompet lan njupuk dhuwit sepuluh&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ewuan) Niki Pak, susuk gangsal ewu nggih Pak.</p>\r\n\r\n			<p style=\"text-align:justify\">Pengemis &nbsp;&nbsp;&nbsp;: Niki mas susuke&hellip;</p>\r\n\r\n			<p style=\"text-align:justify\">Mahasiswa &nbsp;: Lho Pak, kok niki artane pitung ewu?</p>\r\n\r\n			<p style=\"text-align:justify\">Pengemis&nbsp;&nbsp; &nbsp;: Ora apa-apa mas, itung-itung aku ya sedekah menyang sampeyan</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Sapa sing ngekei sedekah?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1153', '19', '\r\n			<p style=\"text-align:justify\"><em>Tertib lalu lintas kudu ditegakake. Dina iki polisi nganakake operasi ing dalan sing dai Kawasan Tertib Lalu Lintas. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Pulisi</strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Geneya kok ora nganggo helm?</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Pengendara</strong> : Helm kula ical Pak.</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Pulisi</strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Yen ilang, pilih tumbas helm apa bayar denda ing kene?</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Pengendara</strong> : &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.</p>\r\n\r\n			<p style=\"text-align:justify\"><strong>Pulisi</strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Piye karepmu iki Le. Ngomong kok molah malih.</p>\r\n\r\n			<p style=\"text-align:justify\"><em>Pulisi banjur ngetokake surat tilang. Montore pengendara kasebut kudu ditinggal. </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Ganepane pacelathon sing pas ing nduwur yaiku &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1154', '19', '\r\n			<p style=\"text-align:justify\"><em>Mbak, Bu Tri Endarwati mengko kondure jam pira?&nbsp; </em></p>\r\n\r\n			<p style=\"text-align:justify\">Tataran basa kang digunaake ing ukara kasebut yaiku&hellip;..</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1155', '19', '\r\n			<p style=\"text-align:justify\"><em>Mas, mengko yen mulih bukuku tulung gawakna </em></p>\r\n\r\n			<p style=\"text-align:justify\">Ukara ing nduwur yen diowahi dadi ukara Krama Alus yaiku&hellip;&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1156', '19', '\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lagi setengah taun aku mulang SMA Negri Mblimbingsari. Ning rasane kok wis rumangsa srek lan seneng. Murid-muridku isih ana rasa hormat lan patuh karo guru, uga nggatekke yen diwulang. Kancaku paron, sing sepuh meh purna tugas ya ana, sedhengan yuswane, lan saangkatanku munggah sithik, isih akeh sing padha mbujang.</p>\r\n\r\n			<p style=\"text-align:right\">(<em>Sumber: www.cerkak-jawa.com)</em></p>\r\n\r\n			<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Amanat saka cerkak ing duwur yaiku&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
