INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1158', '19', '\r\n			<p style=\"text-align:justify\">Tembung telepon yen diowahi mawa aksara jawa dadi &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1159', '19', '\r\n			<p>Ing ngisor iki kang kalebu aksara swara, yaiku &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1160', '19', '\r\n			<p style=\"text-align:justify\">Nalika adhik &hellip; , aku ya &hellip; , lan ibu uga &hellip;</p>\r\n\r\n			<p style=\"text-align:justify\">Tembung kanggo njangkepi supaya trep karo unggah-ungguhe &hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1161', '19', '\r\n			<p style=\"text-align:justify\"><em>Wacanen kang premati! </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Bengi kuwi, sawise rampung tugase nari mbukak kerameyan pahargyan penganten kanthi ngibarake keluwesane joged gambyong Parianom, Ana terus ngleler mulih.&nbsp; Sing dipamiti mesthi wae sing duwe omah, lan sawetara kanca sing weruh lungane. Awake rumangsa lungkrah banget, wong nyatane wis sepasar dhur-dhuran pentas terus.&nbsp; Sawise ucul lan ganti pakeyan, Ana terus ngebrukke awake ing dhipan lumah-lumah. Mau nalika mlebu, ngungak kamare dhe Setro rewange wis katon pules turune. Pengine mono njur arep turu &hellip; ning kok malah nyut &hellip; kelingan bojone sing ditugasake neng Sulawesi nyirep rerusuh. </em></p>\r\n\r\n			<p style=\"text-align:right\"><em>(Sumber: www.cerkak-jawa.com)&nbsp; </em></p>\r\n\r\n			<p style=\"text-align:justify\">Pratelan sing cocok karo isi cerkak yaiku&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1162', '19', '\r\n			<p style=\"text-align:justify\"><em>Wacanen kang premati!&nbsp; </em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>Aku manut. Sawise entuk ijin aku ora mlebu kantor. Dak parani dhokter Tohari, tepunganku. Aku crita apa anane. Ing kiwa tengene omah kontrakanku pancen ana tangga. Nanging yen njaluk tulung terus-terusan rasane ora kepenak.</em></p>\r\n\r\n			<p style=\"text-align:right\"><em>(Jaya Baya No tahun 1999. Hlm 14) </em></p>\r\n\r\n			<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Latar panggonan saka cerkak ing duwur yaiku&hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1163', '19', '\r\n			<p style=\"text-align:justify\"><em>Sabanjure, petugas karo mendelik nakoni Bandhot, &ldquo;Apa sampeyan ora sadhar yen nglanggar aturan? &rdquo;Aturan apa sing taklanggar?&rdquo;, Bandhot balik takon karo malang kerik, &rdquo;Sampeyan mbuwang sampah sembarangan, mbuwang tegesan iku dhendhane&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; gedhe, sampeyan bisa ditahan!&rdquo;, petugas mangsuli karo nesu.</em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Punggelan teks kasebut miturut struktur teks anekdot kalebu perangan &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1164', '19', '\r\n			<p style=\"text-align:justify\"><strong><em>Klenting Ijo</em></strong><em>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;:&nbsp; Yuyu Kangkang, Yuyu Kangkang. Tulung sebrangke aku liwat kali iki. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Yuyu Kangkang</em></strong><em> :&nbsp; Wah, abot banget kuwi. Nanging ana syarate, cah ayu. Ana imbalance. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Klenting Abang</em></strong><em> :&nbsp; Imbalan apa? Dhuwit? Gampang mengko dak bayar. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Yuyu Kangkang</em></strong><em> :&nbsp; Aku ora doyan dhuwit. Aku njaluk ngambung tanganmu wae. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Klenting Ijo</em></strong><em>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;:&nbsp; Weh&hellip; tanganku wis wangi ki. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Yuyu Kangkang</em></strong><em> :&nbsp; Yawis yen kowe wegah ya ora tak sabrangake </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Watek paraga Yuyu Kangkang yaiku&hellip;.&nbsp;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
