INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1169', '19', '\r\n			<p style=\"text-align:justify\">Apa tujuwane saben pertunjukan Tradisional Jawa mesti ana sajen?</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1170', '19', '\r\n			<p style=\"text-align:justify\"><strong><em>Juragan </em></strong><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Wis Dis, awakmu ning kene ojok tambah nggarai keluarga&rsquo;e Pak Joko sedih, awake iki sambang. Gunane sambang iku nglipur lara dudu nambahi lara. </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Bapak Jaka</em></strong><em> : Pancen kabeh salahku gak isok ndidik anakku. Aku njaluk sepura menyang kabeh warga sing onok ning kene, amarga ulahku lan anak-anakku kabeh dai kenek musibah koyok ngene iki. </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Apa amanat sing bisa dijupuk tekan pethikan drama ing duwur&hellip;</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1171', '19', '\r\n			<p style=\"text-align:justify\"><strong><em>Bu Wati</em></strong><em> : &ldquo; Sinten asma penjenengan? </em></p>\r\n\r\n			<p style=\"text-align:justify\"><strong><em>Asih </em></strong><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: &ldquo; &hellip;&hellip;.kula Asih Pratiwi.&rdquo; </em></p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Ukara gothang ing ndhuwur kudune diisi tembung &hellip;.</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1172', '19', '<p style=\"text-align:justify\">Rangkumen artikel ing ngisor iki nganggo basamu dhewe!</p>\r\n\r\n<p style=\"text-align:center\">RUSAKE LINGKUNGAN HIDUP</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp;Rusake lingkungan mujudake deteriorasi lingkungan kang katon saka ilange sumberdaya bumi, banyu, hawa/udara, curese kewan lan rusake ekosistem. Rusake lingkungan bisa mujudake salah sijine bebaya tumrap uriping manungsa. Bab iku wis nate dielingake dening High Level Threat Panel PBB. Rusake lingkungan amarga saka maneka warna sebab, sing paling gedhe pangaribawane yaiku krana pokal gawene manungsa.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Lingkungan alam sing rusak bakal nduweni efek tumrap uripe manungsa lan nduweni potensi bakal kelakon anane bencana ing tembene. Rusake alam bisa disebabake dening faktor alam lan uga manungsa. Manungsa saya srakah lan ora nggatekake lingkungan. Kamangka menawa kita bisa njaga lingkungan, mesthi ora bakal gawe kapitunan tumrap awake dhewe lan generasi mudha.</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1173', '19', '<p>Ing ngisor iki ana pethikan teks pranatacara, urutna pethikan kasebut supaya dadi teks kang runtut!</p>\r\n\r\n<p>(1)&nbsp;&nbsp; &nbsp;Kawula nuwun, ingkang kinurmatan Bapak Kepala Sekolah, saha para guru ingkang kula hormati, ugi dumatheng para siswa, mudha-mudhi ingkang kula tresnani. Keparengan ing mriki kula badhe matur wontwn ngarsa panjenengan sami, minanagka ketua panitya pengetan tanggap warsa Kamardikan RI, ingkang kaping 66 surya kaping 17 Agustus 2021.</p>\r\n\r\n<p><br />\r\n(2)&nbsp;&nbsp; &nbsp;Assalamualaikum Wr. Wb.</p>\r\n\r\n<p>(3)&nbsp;&nbsp; &nbsp;Kaping kalihipun, kula ngaturaken panuwun ingkang tanpa pepindhan, awit sadaya warga SMK ... sampun sami kepareng paring pambyantu punapa kemawon datheng panitya, murih saged ipun kaleksanaan mahargya pengetan dinten Kamardikan RI ingkang kaping 66 surya kaping 17 Agustus 2021.</p>\r\n\r\n<p><br />\r\n(4)&nbsp;&nbsp; &nbsp;Ingkang sepisan, kula mocapaken puji syukur wonten ing ngarsanipun Gusti Allah Ingkang Murbeng Agesang, dene panjenenganipun sampun kersa paring kanugrahan dumatheng kita sadaya Bangsa Indonesia, kathanda ing dalu punika, kita sampun dipun keparengaken makempal kanthi wilujeng ing papan punika, saperlu sami lenggah tirakatan ing malem 17 Agustus punika.</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1174', '19', '<p>Gatekna gambar upacara adat ing ngisor iki banjur pilihen salah siji lan gawea deskripsi apa isi upacara adat ing gambar kasebut!</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_19/641978c99f29f.png\" /></p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1175', '19', '<p>Ing ngisor iki ada pethikan naskah sandiwara kang rumpang, isenana bagian kang rumpang kasebut nganggo unggah-ungguh basa kang trep! &nbsp;</p>\r\n\r\n<p>Vivi : &ldquo;Bu, kula mangke ..... 1 [<em>akan</em>] pinanggih Mbak Reta nggih.&rdquo;<br />\r\nIbu &nbsp;: &ldquo;Iya, nanging mengko dhisik ya, yen arep metu.&rdquo;&nbsp;<br />\r\nVivi &nbsp;: &ldquo;Ibu badhe .....2 [<em>pergi</em>] pundi?&rdquo;&nbsp;<br />\r\nIbu &nbsp;: &ldquo;Menyang ..... 3[<em>rumahnya</em>] Bu RT, ana arisan.&rdquo;&nbsp;<br />\r\nVivi &nbsp;: &ldquo;Mangke ...... 4 [<em>pulang</em>] sampun kesupen ..... 5 [membawa] jajan nggih.&rdquo;<br />\r\nIbu &nbsp;: &ldquo;Iya.&rdquo;</p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1176', '19', '<p>Tembang ing ngisor iki owahana menyang basa latin!</p>\r\n\r\n<p><img src=\"[base_url]uploads/mapel_19/6419793072a11.png\" /></p>\r\n', 2, '', 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1178', '27', '\r\n			<p>Unsur dasar seni rupa yang terkecil dimana semua wujud dihasilkan mulai dari unsur ini, dapat pula menjadi pusat perhatian, adalah unsur ... .</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1179', '27', '\r\n			<p>Dalam unsur seni rupa dimana merupakan salah satu unsur terbentuk dari hubungan beberapa garis, yang memiliki dimensi panjang dan lebar yaitu.....</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
