INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES ('1297', '32', '\r\n			<p>Perhatikan algoritma perancangan dengan pseudocode berikut:</p>\r\n\r\n			<p>Judul : Algoritma Membandingkan dua buah nilai</p>\r\n\r\n			<p>Kamus :</p>\r\n\r\n			<p>A, B: integer</p>\r\n\r\n			<p>Algoritma :</p>\r\n\r\n			<p>input (A,B) if (A&gt;B) then</p>\r\n\r\n			<p>output(&ldquo;Bilangan terbesar A&rdquo;) else</p>\r\n\r\n			<p>if (A&lt;B) then output(&ldquo;Bilangan terbesar B&rdquo;)</p>\r\n\r\n			<p>else</p>\r\n\r\n			<p>Output(&ldquo;Bilangan A dan B sama&rdquo;) endif</p>\r\n\r\n			<p>end</p>\r\n\r\n			<p>&nbsp;Jika A diisi dengan nilai 25 dan B diisi dengan nilai 10 maka outputnya adalah ...</p>\r\n			', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
